R["oh__@brokenstar9"]="{['TS']=1727770914,['Key']='oh__@brokenstar9',['Version']=1773,['na']={[16]={['D']='Have a sweet tooth tickling you? Monster Hunter Bakery has you covered. Whether you are looking for sticky Sweet Rolls, fruity Sugar Soul Gems, or fancy Magic-versary Cake, we have the best. Step inside for a taste sure to satisfy the sweetest cravings.  ',['C']=1.024000,['O']=19918,['N']='bakery2',},[81]={['D']='Where do the hero\\'s go when not on an adventure? To the Hall of Heroes, where they can enjoy dinner and a show, play games, rest, plan their next adventure, and trade stories with good company. ',['C']=1.051000,['O']=19876,['N']='Hall of Heroes',},[34]={['D']='A little art museum to enjoy',['C']=1.030000,['O']=19644,['N']='The Gallery',},[99]={['D']='Looking for the perfect romantic night for yourself or your partner? Come walk the enchanting Glowing Gardens. Set at the magical hour of midnight this peaceful retreat offers a variety of spectacular, luminecent fauna and pools to relax, swim, or cosy up to a book with. ',['C']=1.021000,['O']=19997,['N']='unfinished',},[36]={['D']='Need a place to get away & relax from all the grind? Come Stay at the rESOrt. We have rooms for the whole party. Enjoy the sunny beach,  spacious hot tub,  delicious food, or a relaxing boat ride while enjoying your stay. We can be reached by land or sea seven days a week. Come for your next getaway today. ',['C']=1.007000,['O']=19781,['N']='The rESOrt',},[103]={['D']='Enjoy a visit at this desert paradise. Where you can lounge in the sunny gardens all day or work in the temperate caverns below.',['C']=1.051000,['O']=19876,['N']='Alik\\'r Oasis',},[43]={['D']='Schools in session for children of the dark elves elite. Finda  friend, a hideaway and study for those dreaded exams.',['C']=1.025000,['O']=19666,['N']='Academy',},[47]={['D']='A haunted trail for your spooktacular delight. ',['C']=1.038000,['O']=19644,['N']='Haunted House',},[95]={['D']='Hello little one come inside my abode. I have a delicious treat for you, and a warm fire to rest beside when you are done, but I must warn to look, but not touch anything I don\\'t give you. For many of my things have been gathered from the great tales of myth and faries of old. They hold things unknown and powerful that even I dare not behold. ',['C']=1.026000,['O']=19938,['N']='Gonfalon Bay Inn',},},}"
