R["oh__@kyro_dread"]="{['Key']='oh__@kyro_dread',['TS']=1726450887,['eu']={[34]={['C']=1.021000,['D']='The Garden of Splintered Being is a perplexing wonder for scholars. Many have entered but the garden has made every visitor go mad due to the plantlife appearing \"blurred\", \"warped\" and \"unnatural\". A deceptively beautiful way to lose ones mind.',['N']='Splintered Being',['O']=19736,},[99]={['C']=1.026000,['D']='The Dread Fang has cried for aid, and has called you by name to assist the Aldmeri Dominion\\'s brave souls on board to defend thier great galleon from a greater malignance that swarms in the sky. Rumour is, that it\\'s a dark anchor invasion, but those are all gone...right?',['N']='The Dread Fang',['O']=19949,},[68]={['C']=1.026000,['D']='\"Perhaps during the planemeld, tiny pieces of Coldharbour and Nirn swapped places? Oh Arkay\\'s beard, I don\\'t know. What I do know is that there\\'s an angry scamp in there with...is that gold?\"',['N']='Scamp\\'s Hoard',['O']=19573,},[71]={['C']=1.017000,['D']='Mainly built to have fun with structural pieces and turned into a huge castle, so not many interior furnishings! Enjoy! :D',['N']='KyRo\\'s Grand Palace',['O']=19982,},[72]={['C']=1.029000,['D']='Dedicated to some friends that don\\'t play/ don\\'t play much eso anymore. Styled to fit their personalities and what they liked in the game.',['N']='Hall of Dark Legends',['O']=19573,},[42]={['C']=1.032000,['D']='Witness a legendary space mission come to fruition, as a tiny space craft lands on a desolate moon, whilst great celestial beast spirits spectate in awe.',['N']='Lunar Anticipation',['O']=19962,},[43]={['C']=1.026000,['D']='\"The Lake Lodge? Yes, this one knows of the place. R\\'ishkargi heard it was taken over by a wealthy dunmer and was made into an inn!\"\\r\\n\\r\\n\"Well i\\'m never going in there. It seems pleasant sure, but I swear i heard bats and screeching from inside one night, something\\'s not right with that place; Z\\'en protect me.\"\\r\\n\\r\\n\"Hah! Have you stolen this one\\'s skoo- ah... moon sugar biscuits? You look like you have seen an angry Senche-Raht! heh...you sound quite mad to R\\'ishkargi...\"',['N']='Vampire-owned inn',['O']=19573,},[77]={['C']=1.041000,['D']='A tiny pet store in Solitude, specialising in Snakes.\\r',['N']='Snek Shop',['O']=19573,},[14]={['C']=1.026000,['D']='A simple bosmer house decorated to fit the small elves of Valenwood.',['N']='Simple bosmer house',['O']=19573,},[47]={['C']=1.026000,['D']='There was once said to be an immensely powerful Valkynaz in service to the God of Schemes called Tysefyr. His sadistic methods of torture amused the daedric price and the Valkynaz was gifted a great keep in ColdHarbour. He has since fallen out of favour of the dark lord and Tysefyr\\'s domicile is now desolate. Will you dare to claim it?',['N']='Valkynaz Keep',['O']=19952,},[80]={['C']=1.051000,['D']='A grand Viking Longhouse stands proud on a frozen lake deep within skyrim\\'s snow-kissed lands. The very breeze whispers and distantly sings with storied histories as it glides past strong wooden supports of the hall. You are welcome, but take time to bask in the silence of great Jarls who came before. Nature claims all, but the majesty of the Longhouse endures.',['N']='Viking Longhouse',['O']=19976,},[49]={['C']=1.026000,['D']='As the threat of vampires in western skyrim rises, a small, out of the way witch hut has drawn unwanted attention and scared off many a traveller who dares to go near it. It appears the witch inside belongs to the Icereach coven and is conducting malevolent experiments to aid the Grey Host.',['N']='Icereach Witch Hut',['O']=19573,},[86]={['C']=1.026000,['D']='Vorellian is a name the Psijics want struck from history, and for good reason. In an attempt to gain absolute mastery of lightning magic through any means necessary, Vorellian was banished from the Psijic Order due to his cruel and unspeakable methods. Now what\\'s left of his fury and unwavering persuit of knowledge resides in the ancient Ayleid ruin only known to outsiders as Varlaisvea, but to Vorellian it is his path to ascension, his near infinite well of power, his...rebirth.',['N']='Vorellian\\'s Rebirth',['O']=19897,},[90]={['C']=1.016000,['D']='Are you an EDM enjoyer? Want to listen to your favourite music at a great festival in the DeadLands? Look no further than Oblivions best EDM Fest! (Food & drink provided alongside tents near the main stage). (Tickets and luggage checked upon entry). ',['N']='EDM Festival',['O']=19962,},[58]={['C']=1.044000,['D']='The most elegant number two you\\'ll ever have.',['N']='Altmer Toilet',['O']=19573,},[81]={['C']=1.030000,['D']='\"Hmmm? What? Can\\'t you read the sign? It\\'s exactly what you think it is... A lore museum. No i\\'m not going to give you a history lesson, go inside for that. Ysmir\\'s hairy arse, i\\'m a guard, I don\\'t get paid enough for this.\"',['N']='Lore Museum',['O']=19573,},[17]={['C']=1.041000,['D']='A suitable place for a weary adventurer.',['N']='Adventurer\\'s Rest',['O']=19573,},[62]={['C']=1.011000,['D']='Visit this masterpiece and you too can learn to never touch grass',['N']='KyRo\\'s Flex House',['O']=19566,},[13]={['C']=1.026000,['D']='Day 18 - Fredas 5th Frost Fall\\r\\n  Tharayya told me to forget about it, but this is to big to pass up on. It\\'s a pristine Dwemer ruin for Mara\\'s sake. Why would she make such an amazing find and choose to leave it? Something\\'s not right.\\r\\n\\r\\nDay 21 - Morndas 8th Frost Fall\\r\\n  I can\\'t keep my hands steady as I write this. The constructs are building something. Something... sinister. They know i\\'m here. They... command me. The gears turn. Must assist them. Steam hisses. Kagrenac\\'s vision. Numidium.',['N']='The Minidium',['O']=19897,},},['Version']=1773,}"
