R["oh__@barblebapkins"]="{['TS']=1725386521,['Key']='oh__@barblebapkins',['Version']=1773,['na']={[38]={['N']='Keep of Shadows',['O']=19957,['C']=1.023000,['D']='In a bygone age, this castle was used as the residence of the Glenumbra nobility before the grander castle in Daggerfall was built. Now it sits abandoned, giving way to the ravages of time. However, rumors in Daggerfall whisper of a Necromancer taking up shelter in the old keep, and the shroud of darkness that surrounds the estate seems to support these rumors. What could be going on inside those old stone walls?',},[41]={['N']='The Hall Of Luxuries',['O']=19958,},[62]={['N']='The Fractured Hall',['O']=18869,},[55]={['N']='Anacario\\'s Lab',['D']='The laboratory of Anacario, apostle and personal student to Sotha Sil. The space seems cluttered to most, but to his eccentric mind every object has it\\\\\\\\\\\\'s place. Contraptions and complicated machinery dot the estate, each piston and gear serving some purpose great or small.\\n\\nNOTE: Many switches in the house have a function with EHT installed! Try stuff out!',['C']=1.027000,['O']=19969,},},}"
