R["oh__@elliebeing"]="{['na']={[11]={['D']='Recent excavation of sites surrounding the Ayleid city of Silyanorn have offered some few noteworthy relics: shards of tablets, and an unusual jeweled skull. Suspected to be from one of the ancient city’s late rulers, few have been near the thing without experiencing bouts of illness and nausea. However, one individual, following an episode of forgetful madness, has seemed immune to its effect then on. The relic has now been relocated to the shared dwelling of this indebted warrior. ',['N']='Ancient Mudhouse',['C']=1.026000,['O']=19967,},[31]={['D']='Quaint from the outside, this icy home serves as the refuge for a local healer, of sorts. Normally keeping her more grim nature under wraps, its inhabitant offers her services to the nearby city of Wayrest and the local arena. As for her true background, there is much to learn for those bold enough to break the ward set over this place. (Some hidden secrets, and nine custom lore-friendly books laying around.)',['C']=1.026000,['N']='Witchdoctor\\'s Hovel',['O']=19968,},},['Version']=1773,['Key']='oh__@elliebeing',['TS']=1725291029,}"
