R["oh__@kalliana223"]="{['Version']=1773,['Key']='oh__@kalliana223',['TS']=1724443883,['na']={[80]={['D']='My entry for a pet cage contest!  The contest was limited to 15 items for a pet cage cobble, which I used inside the tank itself.  Everything else was deemed acceptable by the judges since it was outside the actual \"cage\"  Enjoy  <3 Kali',['O']=19807,['C']=1.012000,['N']='Fishie Tank',},[71]={['D']='Welcome to my hobbit home!  Come check out ESO\\'s only (probably) gravity fed toilet, a working refrigerator, a D&D table, multi-story fairy garden, and much, much more!',['O']=19955,['C']=1.021000,['N']='Hobbit Home',},[13]={['D']='Hi!  Welcome to my Wood Elf fairy throne room  :)',['O']=19955,['C']=1.021000,['N']='Fairy Room',},[37]={['D']='Come visit my Backyard BBQ!!!  Complete with a movie theater, yard games, full bath, and a giant feast!!!  Make sure to check out the rotisserie  :D',['O']=19955,['C']=1.013000,['N']='Backyard BBQ',},[5]={['D']='Hi, and welcome to my study!  Here, feel free to grab a book and stay a while.  I love to leave \"glowing\" reviews of books from my desk!',['O']=19643,['C']=1.025000,['N']='Book Nook',},[38]={['D']='Welcome to Kali\\'s Market! Here you will find things to amaze and entertain you, to feed  your belly and woo your senses! As you walk in, become spellbound by the dazzling fountain. Have a seat, make a wish, take in the sunglow effect to prepare you for the wonders to follow!\\r Visit the Eye of the Bookholder shop, where the Seeker of Knowledge knows exactly what you seek. Find your favorite scent in the Atlantean Atlier, being sure to stop in the doorway for a lilac and honey blessing!',['O']=19955,['C']=1.041000,['N']='Kali\\'s Market',},[47]={['D']='Welcome to THE MAZE of Amazement!\\r\\n\\r\\nHere, you will find twists and turns that will confuse, surprise, and mildly frustrate you  :D  It is designed to make you question everything you know, while challenging your sense of stability and direction.  This is best experienced WITH SOUND!',['C']=1.003000,['O']=19958,['N']='5 Hidden Rooms Maze',},},}"
R["oh__@loosemorals"]="{['Version']=1773,['TS']=1724444289,['na']={[80]={['D']='NARNIA!!\\nunfortunetly still under construction as the game wont give me the fonts of aurial i need to finish ice palace. but still nice to visit.\\nI build with vanilla so no fancy FX sorry.',['O']=19958,['N']='Wardrobe to Narnia!',['C']=1.020000,},[49]={['N']='Jacks Beanstalk.',['O']=19958,['D']='Jacks Mum threw the beans out the window before she went to bed.\\nNeither of them know whats happened to thier garden yet.\\ni build vanilla, so no fancy FX sorry.',['C']=1.020000,},[98]={['D']='This is my wizards tower.\\nNo, it is not a bloody mushroom (I hate those mushroom towers^^)\\nWas going more for the Merlin from disney sword in the stone vibe.\\nAlso features an almost complete library with all books readable. (still need 20 from scriveners hall and a few from furniture packs)\\nNearly 400 books will make decorating the rest of the place a bit hard, but ive done my best.',['O']=19958,['N']='Wizzards Tower.',['C']=1.020000,},[70]={['N']='The Best Guild Hall.',['O']=19958,['D']='My own personal take on the \"Guildhall\". with all bells and whistles it most definately my most expensive build to date^^',['C']=1.010000,},[58]={['D']='As close as i could get to a modern studio flat..using only a limited number of slots for the smallest house size.\\nI build vanilla, no fancy FX sorry.',['O']=19958,['N']='Xbox in studio flat.',['C']=1.046000,},[89]={['N']='Blackwood Chapel',['O']=19102,['D']='Everyone enjoys a good harvest festival...well almost everyone. dont miss the fun and game round the side of the chapel. the ghost train was fun to build.\\nI build vanilla so no facy FX sorry.',['C']=1.016000,},[90]={['D']='Dagon aint a Kaiju. but im still gonna build a Jeager to give him a whomping.\\n',['O']=19958,['N']='we need a BIG robot!',['C']=1.042000,},[75]={['N']='Airship for Weddings',['O']=19958,['D']='Wedding venue with a very special wedding barge. The alter also has a very nice last minute escape hatch for the groom...if he is \"dead\" set on leaving^^\\nI build vanilla so no fancy FX sorry.',['C']=1.013000,},[76]={['N']='Midspring Town',['O']=19102,['D']='A sleepy little town with a murder to solve. I entered this in a guild event. it had some documentation but you can still figure out who the murderer is if you try.\\nI build vanilla, no fancy FX. sorry.',['C']=1.023000,},[61]={['N']='Fly Me to the Moon!',['O']=19958,['D']='A group of scholars are trying to determine if Hircines moon is similar to the moons of Nirn.. only way to find out is to go there i guess.\\nI build with vanilla. so no fancy FX sorry^^',['C']=1.027000,},[78]={['N']='Mc Daedric\\'s',['O']=19151,['D']='Did you ever wish Mc Donalds would come to Tamriel? ',['C']=1.050000,},[11]={['N']='Downed UFO',['O']=19102,['D']='The UFO has crashed. making quite the impact crater. Don\\'t worry Robbie will get it cut free in no time.\\nthe door to inside is a bit tricky but well worth a look if you can figure out the door handle.\\nI build vanilla, no fancy FX sorry.\\n',['C']=1.032000,},},['Key']='oh__@loosemorals',}"
