R["oh__@jester_cat"]="{['TS']=1724158485,['Version']=1773,['Key']='oh__@jester_cat',['na']={[64]={['D']='Murkmire and Argonian',['N']='SwampArgonianHome',['C']=1.500000,['O']=19954,},[76]={['D']='I also kept this one redguard style.  A desert retreat is too much fun!',['N']='My Desert Oasis Home',['C']=1.051000,['O']=19954,},[98]={['D']='Welcome to the Fogbeak Lighthouse and Winery!  I used a lot of the green furnishings from Gold Road, to give the interior a cottagecore feel.  I also used a bunch of autumnal trees from the chapter to add contrast and warmth.  ',['N']='ColoviaThemeWineIsle',['C']=1.018000,['O']=19954,},[43]={['D']='I put Elsweyr and wood elf themes in it.  Wanted to give off a slight New Mexico feel.',['N']='SouthwestThemeEstate',['C']=1.047000,['O']=19954,},[78]={['D']='Redguard Lounge!  I thought the tile floor was perfect for desert themes.',['N']='RedguardTavern Inn',['C']=1.500000,['O']=19954,},[69]={['D']='This is my \"secondary\" home.  Elsweyr themes.',['N']='MySecondaryElsyHome',['C']=1.500000,['O']=19954,},[102]={['D']='I was desperate to have an Alinor style smaller home, and this was the result.  I mixed Colovian into it for some variety and I love it!',['N']='Dark Noble ColoAlino',['C']=1.051000,['O']=19954,},[92]={['D']='Elsweyr theme as a base, with lots of color and a stellar garden!',['N']='MysticDesertMansion',['C']=1.051000,['O']=19954,},[8]={['D']='Resurfaced with Leyawiin building components!',['N']='LeyawiinReskinHouse',['C']=1.500000,['O']=19954,},[73]={['D']='This was my primary for a long time.  Elsweyr stuffs!',['N']='FormerElsweyrPrimary',['C']=1.500000,['O']=19954,},[74]={['D']='My primary!  Decorated with everything Elsweyr and feline I could found, along with momentos of my journeys,',['N']='My Eccentric Elsweyr',['C']=1.500000,['O']=19954,},[75]={['D']='Longhouse decorated with Solitude furnishings, building decorated in Redguard style.  Vacation home for Sai and Lyris.',['N']='OrcRetreat&Redguard',['C']=1.500000,['O']=19954,},[108]={['D']='It\\'s just an Elsweyr themed house, but I made a whimsical garden outside!',['N']='MysticElsweyrGarden',['C']=1.021000,['O']=19954,},[27]={['D']='Blackwood themed!  Once again, I did one of my favourite things by putting Leyawiin style furnishings in a base game Imperial home.  ',['N']='LeyawiinThemeBigHome',['C']=1.051000,['O']=19954,},[46]={['D']='St. Alessia Mercy Regional Hospital.  Complete with multiple wards, operating theater, showers, and cafeteria.',['N']='St. Alessia Hospital',['C']=1.007000,['O']=19479,},[79]={['C']=1.038000,['N']='Vampire Castle O,.,O',['D']='A vampire castle, with more conventional spooky elements, as opposed to copy and pasting vampire furnishings everywhere.',['O']=19955,},[16]={['D']='It\\'s a grocery store!',['N']='JestoMart Grocery',['C']=1.007000,['O']=19954,},[17]={['D']='Decorated with all my bound Imperial furnishings.  Build a graveyard in the back to make it spooky like the rest of Rivenspire.',['N']='BaseGameImperiBreto',['C']=1.051000,['O']=19954,},[18]={['D']='The Embassy of Orsinium located in Wayrest, a Breton home decorated in the style of the Orcs!',['N']='Embassy of Orsinium',['C']=1.500000,['O']=19479,},[19]={['D']='Traditional Dark Elf home.',['N']='Kragenmoor House',['C']=1.051000,['O']=19479,},[66]={['D']='Leyawiin Arena!  Decorated with Leyawiin furnishings, and with aquariums, shops, and volcano!',['N']='Leyawiin Arena',['C']=1.001000,['O']=19479,},[25]={['D']='',['N']='LeyawiinSmallHome',['C']=1.500000,['O']=19954,},[34]={['D']='I made a casino!  Utilized every game furnishing I could find, with Tales of Tribute items, and Redguard decor for atmosphere.',['N']='The Tributary Casino',['C']=1.007000,['O']=19479,},[28]={['D']='',['N']='HumbleSolitudeThemed',['C']=1.500000,['O']=19954,},[32]={['D']='High Isle resurfaced home.',['N']='HighIsleReskinedHome',['C']=1.500000,['O']=19954,},[89]={['D']='Decorated in Leyawiin style, complete with torture chamber in the tower basement.',['N']='LeyawiinThemeMansion',['C']=1.017000,['O']=19954,},[58]={['D']='Heart\\'s Day furnished suite.',['N']='Alinor Inn',['C']=1.500000,['O']=19479,},[59]={['D']='It\\'s just an Alinor-themed house in Alinor.',['N']='AlinorThemeEZHome',['C']=1.500000,['O']=19954,},[60]={['D']='Main ship decorated in Leyawiin style.  Upper ship is Elsweyr style.',['N']='The Crooked Calico',['C']=1.015000,['O']=19954,},[49]={['D']='Murkmire themed!  Filled the place with Argonian wares and took advantage of the natural fog.',['N']='MurkmireThemeHut',['C']=1.500000,['O']=19954,},[38]={['D']='',['N']='Vampire Manor O,.,O',['C']=1.500000,['O']=19954,},[31]={['D']='Orc house made with leftover bound Orc furnishings.',['N']='Hammerdeath House',['C']=1.500000,['O']=19479,},},}"
