=0,['SizeY']=400,['Yaw']=5.222025,['Id']=1164,['MetaData']={['message']='1. This started as part of a wayshrine contest.\\nThe theme, \"it has to have a flame, a pedestal, and\\na stair leading up to it.\" So, my theme...\\n\"What if Sotha Sil built a Universal Wayshrine so\\nmighty, it required the power of all of Nirn to run it?\"',},['Groups']=0,['Alpha']=1,['SizeZ']=400,['Color']=99,['Y']=50602,['Contrast']=1,['X']=56778.595786,},[10]={['Roll']=0,['EffectType']=4407,['SizeX']=1140,['Z']=105153.320782,['Pitch']=0,['SizeY']=322,['Yaw']=4.405211,['Id']=1165,['MetaData']={['message']='2. So, I built the wayshrine in the basement of the house. Having done\\nthat, I decided to go overboard (because reasons), and converted the\\nwhole house to support that theme. This is the result: The culmination\\nof Sotha Sil\\'s ambitions to build a wayshrine to pierce Aetheriuis. Alas, that\\ndoesn\\'t mean they work the way you want.',},['Groups']=0,['Alpha']=1,['SizeZ']=322,['Color']=99,['Y']=50627,['Contrast']=1,['X']=56890.288806,},[11]={['Roll']=0,['EffectType']=4407,['SizeX']=1060,['Z']=106117.689900,['Pitch']=0,['SizeY']=362,['Yaw']=2.872812,['Id']=1166,['MetaData']={['message']='3. The exterior of the house holds his power plants, flooding his clockwork\\nconstruct with pure energy. They are combined in the center, then\\nrouted inside to the left of the doorway. You can follow that conduit down\\nto the lower levels, where equipment deactivated, and the door to the \\nWayshrine secured by an energy field, until you throw a switch to complete\\nthe circuit. To a Clockwork Laser.\\nYou may also explore the Viewing Room on the main floor, which overlooks\\nthe machinery floor that powers the Wayshrine below.\\n\\nEnjoy a sweetroll while you are there. The Dwarven chefbot is quite skilled\\nat baking.',},['Groups']=0,['Alpha']=1,['SizeZ']=362,['Color']=99,['Y']=50587,['Contrast']=1,['X']=55100.971242,},[12]={['Roll']=0,['EffectType']=4407,['SizeX']=1100,['Z']=105469.308936,['Pitch']=0,['SizeY']=422,['Yaw']=2.066470,['Id']=1167,['MetaData']={['message']='4. Pass through the door, and the shrine will be inert (powered off), and the\\nway forward blocked by a security field. Throw the switch next to the gate,\\nand it will deactivate the security field and power up the Wayshrine, with\\neverything coming alive.\\n\\nOne last thing: The wayshrine project was a success. (If you use EHT.)\\n(You may also notice some off-theme furniture behind these walls... Don\\'t\\nmind the mess, sometimes it helps to do a little decorating jazz to get the\\njuices flowing.)\\n\\nI hope you enjoy this build. Please let me know if you do!\\n\\n-T.',},['Groups']=0,['Alpha']=1,['SizeZ']=422,['Color']=99,['Y']=50589,['Contrast']=1,['X']=54265.949946,},[13]={['Roll']=0,['EffectType']=1010,['SizeX']=1,['Z']=94325.420734,['Pitch']=0,['SizeY']=1,['Yaw']=2.059489,['Id']=1168,['MetaData']={['then group furniture']='4612199632093272950,4612199632092892744,4612199632093450845,4612199632093451730,4612199632093451731,4612199632093451729,4612199632092394534,4612199632092187460,4612199632093454084,4612199632093454574,4612199632093454569,4612199632093454575,4612199632093274539,4612199632093454083,4612199632093454082,4612199632092201436,4612199632093454567,4612199632093454586,4612199632093454584,4612199632093450259,4612199632093455713',['is']='On',['will be']='On',['when furniture']='4625903927840869831',['then group']='Staging Area Lights',},['Groups']=0,['Alpha']=1,['SizeZ']=1,['Color']=999998,['Y']=49157,['Contrast']=1,['X']=50741.557861,},[14]={['Roll']=0,['EffectType']=1010,['SizeX']=1,['Z']=94008.253979,['Pitch']=0,['SizeY']=1,['Yaw']=0.488692,['Id']=1169,['MetaData']={['then group furniture']='4612199632093272950,4612199632092892744,4612199632093450845,4612199632093451730,4612199632093451731,4612199632093451729,4612199632092394534,4612199632092187460,4612199632093454084,4612199632093454574,4612199632093454569,4612199632093454575,4612199632093274539,461219963209345408