R["oh__@turgenev"]="{['na']={[49]={['C']=1.044000,['D']='My submission for Chopped 2022. So, this house has a preface that I\\'ve trimmed down to fit in a custom book, just as you enter the home (look to the left, on the hay cart) Please read the \"Audio Log\" portion in particular for a proper setup. ;)',['N']='Mistaken Identity',['O']=19208,},[86]={['N']='Hanging Gardens',['O']=19060,},[3]={['C']=1.032000,['D']='A revamp of the Steampunk Guarship, now using a few more FX to make the experience more convincing. :)\\nThis began as an effort to make this single room into a chapel of Azura.\\nI deviated far, far, far from that plan.\\n\\nEnjoy, Stabbity. ;)\\n\\n-T.',['N']='Steampunk Guarship',['O']=19032,},[36]={['C']=1.024000,['D']='Club LUMOS: A trending nightclub on the shores of Stros M\\'Kai, LUMOS  attends to the discerning patron with light and delicate comestibles; seasonal meat specialties; fresh seafood; and for your entertainment, a stage where choice performers from across Aetherius alight to delight you with song and joy.\\r\\n\\r\\nLUMOS - Wine. Wonder. Song.\\r\\n\\r\\n(For best effect, play \"Feeling Good,\" by Nina Simone and covered by Apashe and Cherry Lena, while touring the main club floors.)',['N']='Club LUMOS',['O']=19390,},[69]={['C']=1.032000,['D']='3rd of themed \"guars in space\" houses for Locke\\'s Chopped contest. (See \"Mistaken Identity I and II\") This house also has an audio tour, link below (it\\'ll tell the whole story). Follow Kaptu, a Guar chronicler, as he weaves his tale about Bastian Firebeard. Enjoy!\\n\\nhttps://bit.ly/OneYearLaterWalkingTour',['N']='One Year Later...',['O']=19373,},[6]={['C']=1.007000,['D']='WARNING: This house is the end of a Sithis script in my DOOMCHAR house. I accidentally published it last night, and two people already really liked it and said to keep it open... so VISIT AT YOUR PERIL. YOU WILL LIKELY DIE. Contact me for the full scripted experience in Doomchar! (Or just visit anyway! :))',['N']='Just Desserts',['O']=19011,},[55]={['C']=1.027000,['D']='NOTE: Please game-mail me if you are unable to trigger the switch/portal in the basement. I checked the published version, and it seems fine, and yet...\\n\\nThis house originally started as a wayshrine contest. I went with the theme, \"What if Sotha Sil made a Universal Wayshrine so mighty, it required the power of the whole world to run it?\" The rest of the house accreted around that shrine to build the theme of raw power. More words on the wall behind you when you arrive. Read that. ;)',['N']='Clockwork Wayshrine',['O']=18914,},[72]={['C']=1.007000,['O']=18752,['N']='The Imperial Retreat',},[62]={['C']=1.020000,['O']=18753,['N']='Hogwarts, Halloween',},[90]={['C']=1.017000,['D']='Since the days the Vestige joined the Dark Brotherhood, the assassin\\'s guild has answered Black Sacraments from all the planes of Mundus and Oblivion. To facilitate this explosive demand, the Sanctuaries banded together to erect, with mortar & magick, a nomadic citadel. Untethered to the earth, it glides silently upon extraplanar winds. Its purpose: to serve their Night Mother & their Dread Father, Sithis.\\nTo reap souls.\\nTo feed the Void.\\r\\n\\rThe Brotherhood named this grim keep the Black Halo.',['N']='Black Halo Keep',['O']=19013,},[33]={['C']=1.044000,['D']='The 2nd of a house trilogy, this follows the events of my Exorcised Coven Cottage, where a Guarfleet cruiser attempted to tractor in their downed pilot, but got Bastian the Farmer instead. This house should be seen in step with Bastian\\'s run through. The 3rd house is not yet chosen, but the final emergency transporter on the bridge DOES work... kinda...',['N']='Mistaken Identity II',['O']=19279,},[92]={['C']=1.039000,['D']='Presenting the furnished option for the house, for those who might want to see and catalog the pieces prior to purchase. I\\'ll do something with this house in a few months. :) To be continued!',['N']='Furnished Demo',['O']=19061,},[93]={['C']=1.042000,['D']='This is more for convenience for anyone who wanted to see the house and identify the furniture pieces more closely. Plus, Arox is right at the front door. :) Say hi if you appreciate the hosting!',['N']='Furnished + Arox',['O']=18983,},[94]={['C']=1.002000,['D']='In \"Dream Quest of Unknown Kadath,\" Carter, a Dream master, dreams of a perfect, lovely sunset city, which the earth gods coveted, and took from him thrice. He travels in Dreams to Leng, a frozen, sunless waste where the god-city Kadath lies, guarded by huge sentinels. Kadath is empty, but he faces Nyarlathotep of Chaos, who says the gods quit to live in his city, and the GREATER gods are angry. Please read Lovecraft\\'s novel for context. Be sure to find your way below. ;)',['N']='God-City of Kadath',['O']=19955,},[5]={['C']=1.022000,['D']='A perfect Yuletide morning moment, for a mage and his family.\\n\\nHappy holidays, ESO. Enjoy. (And wait for the blue light from the windows to render, it changes the experience for you. :))',['N']='Mage\\'s Yule Morning',['O']=19342,},},['Key']='oh__@turgenev',['TS']=1724125712,['Version']=1773,}"
