R["oh__@taemersforth"]="{['Key']='oh__@taemersforth',['eu']={[71]={['C']=1.037000,['D']='A thousand years ago, when Akatosh took his rightful place in the firmament of the gods, he said to his priests: \"Build me a temple to worship my divinity!\" And the priests began their work. Brick by brick they built the Temple of Akatosh. But the dragon god deceived the other gods of the firmament and so they cast him out. The priests fled, and no song or prayer was ever sung in his honor. The temple was forgotten.',['O']=19954,['N']='Temple of Akatosh',},},['TS']=1724093373,['Version']=1773,}"
