R["oh__@tristorm"]="{['eu']={[16]={['C']=1.010000,['O']=19391,['N']='The Imperial Reserve',['D']='The Imperial Reserve\\nLocated in an undescript location.\\nThis small cozy bank is operated by the magnificent Ezabi the Banker, she is there for all your needs!\\n{Inspired by old English Post Offices}',},[89]={['C']=1.017000,['O']=19391,['N']='Castle Septimus',['D']='Castle Septimus\\nLocated on the Silverfish River, Cyrodiil.\\nCastle Septimus is the home and seat of power of Lord Caladius Septimus VII.',},[43]={['C']=1.026000,['O']=19391,['N']='Ruhn Torval',['D']='Ruhn Torval\\nLocated in western Vvardenfell, near Balmora.\\nRuhn Torval is home to the Ordinator Knight-Commander Torval Indoril. Devout man of the Order of Doctrine.\\n',},[60]={['C']=1.015000,['O']=19392,['N']='Isla Apraxis',['D']='Isla Apraxis\\nLocated in the seas between High Isle and Summerset- this hidden island has traded hands through all different cultures. Once the home to a wealthy lord, this estate is now a dingy pirate tavern and home to the infamous Captain Huzar\\'ahad at-Sahdal.',},[78]={['C']=1.026000,['O']=19391,['N']='Septimus Manor',['D']='Septimus Manor\\nLocated at the crossroads outside Dragonbridge.\\nThe personal home of Lord Caladius Septimus VII, built in the location of an ancient mead hall.\\nAccessible through a mysterious, transmission mirror from Castle Septimus.',},[71]={['C']=1.021000,['O']=19392,['N']='Merry Blossom Meadow',['D']='Merry Blossom Meadow\\nLocated in the hills bordering Cyrodiil and Anequina.\\nMerry Blossom Meadow is the tranquil home of retired Imperial City Arena Champion, Te\\'shen-Dar.\\nOnce a slave, now a master of his own, peaceful fate.\\n{Inspired by Edo Japanese homes and farms}',},},['Key']='oh__@tristorm',['Version']=1773,['TS']=1723576641,}"
