R["oh__@barovia"]="{['Key']='oh__@barovia',['TS']=1722455540,['Version']=1773,['na']={[17]={['O']=19844,['N']='The Dollhouse',['D']='It’s a “Snake-&-Cake” themed Birthday Party at the Ravenhurst family home and you’re invited! Enjoy live entertainment in the backyard including a birthday clown, and staging for a live band. There’s plenty of games, an art room, a pond to splash around in, and more! House includes living space for 2 parents, 3 children, 2 infants, a pet cat, and a family horse.',['C']=1.022000,},[82]={['O']=19050,['N']='Moon Prince Festival',['D']='The Festival of the Moon Prince! Games, rides, pirate shanty wedding venue, haunted crypt camping, and luxurious honeymoon suite (many guest quarters available as well). Come and honor Tamriel\\'s \"Dark Moon\", Lorkhaj, at this magical event locale! Built in collaboration with @FearlessAce - be sure to check out their other open houses as well!',['C']=1.016000,},[68]={['O']=19935,['C']=1.026000,['D']='Themed in honor of Jode - Tamriel\\'s great red moon - this sumptuous red-and-gold Khajiiti apartment Suite is available for rent in the beating heart of Elsweyr.',['N']='Blood Moon Inn',},[22]={['O']=19844,['N']='Blue Moon Landing',['D']='Come and relax at this blue-and-gold pirate-themed Khajiit getaway. Invite your Senche friends, pet the cat(s) and enjoy the moonsugar, the aquarium, and the “once in a blue moon” light of Jone as you plan your next heist. I mean \"fishing trip\"...',['C']=1.026000,},[49]={['O']=19844,['N']='Shadowscale\\'s Solace',['D']='An Argonian Necromancer has made Hag Fen her hermitage. Born under the sign of the Shadow, she was dedicated to Sithis at birth. That said - she enjoys her creature comforts like anyone. She has ventured far from her home-hists, but the Hag Fen reminds her of the swamps of her youth, and the “abandoned” stone hut she “found” echoes the great stone Xanmeers of Murkmire. Site includes a lovely picnic area for company she is glad to see, and a graveyard for u