R["oh__@luluzealander"]="{['Key']='oh__@luluzealander',['TS']=1715534849,['eu']={[16]={['D']='A tiny studio apartment, where a talented and eccentric artist live.',['N']='Painter\\'s Studio',['O']=19197,['C']=1.007000,},[49]={['D']='The Dark Feast\\n\\nThe sinister home for a gluttinous Daedra and it\\'s companions. Be careful, or you might end in one of it\\'s dishes...\\n',['N']='The Dark Feast',['O']=18925,['C']=1.038000,},[34]={['D']='In the otherwise dry and harsh landscape of Bangkorai lies a hidden and cherished oasis paradise. High walls surround and protect a life-giving spring and lush garden. It is a small Shrine dedicated to Dibella and it is kept with love and attention by her devoted followers. For the most tranquil experience (with the best light) I advise you to visit when there are no sandstorms in the area.',['N']='Oasis of the Lily',['O']=19380,['C']=1.029000,},[104]={['D']='\"The Arcanist\\'s Hideaway\"\\n\\nA telvanni/necrom house - a home befit any dark elf arcanist, with it\\'s own sacred shrine to their ancestors.\\n\\n1st person and clear weather for window reflections adviced, for the best experience.',['N']='Arcanist\\'s Hideaway',['O']=19841,['C']=1.007000,},[81]={['D']='This sleepy town in Solitude is well guarded, and preparing for a grand feast, hosted by their Jarl! Come and join!',['N']='The Jarl\\'s Feast',['O']=19855,['C']=1.026000,},[70]={['D']='\\r\\nThis is a compilation-build and homage to H.C. Andersen\\'s endearing fairytales. It contains stories, such as:  Princess and the Pea, The Flying Trunk, Clumsy Hans, The Swineherd, The Nightingale, The Little Mermaid, Thumbelina and The Tinderbox.\\n\\nI advice visiting during clear weather, for the window reflections to work and in first person - for the best experience!',['N']='H.C Andersen Tales',['O']=19840,['C']=1.040000,},[71]={['D']='An all exterior build of a \"fazenda\" (southern american ranch) with horses.  A perfect destination for a one of a kind day in the sun!\\n',['N']='El Sol Ranch Estate',['O']=19840,['C']=1.047000,},[88]={['D']='Welcome to Esme\\'s Seafood Shop. A store filled with delicious fish and seafood, in any form you prefer; fresh, smoked, baked and cooked! ',['N']='Esme\\'s Seafood Shop',['O']=19359,['C']=1.024000,},[28]={['D']='A small and cozy autumn cottage with a Thanksgiving Feast inside.\\n\\n1st person and clear weather adviced for best experience.',['N']='Autumn\\'s Abundance',['O']=19840,['C']=1.033000,},[10]={['D']='A tiny cottage located in a remote and overgrown forest area in Tamriel. This tiny rustic and cute home is the perfect setting for drinking a cup of tea, reading a book or playing a game with a friend.\\n\\nVisit during clear weather for window reflections.\\n1st person view adviced for best experience.',['N']='Tiny Cottage',['O']=19840,['C']=1.047000,},[59]={['D']='Welcome to the Manor of Dibella - a luxurious home within the city of Alinor. You are welcome to use this for roleplay sessions too!',['N']='Manor of Dibella',['O']=19840,['C']=1.007000,},[44]={['D']='A traditional japanese inspired house and garden. Come visit and feel the tranquility.',['N']='Sakura no yakata',['O']=19744,['C']=1.051000,},[13]={['D']='This is the homely, cozy and natural den of a Wood Elven Druid, whom honours the Green Pact and Y\\'ffre.',['N']='A homely Druid\\'s den',['O']=19365,['C']=1.026000,},[14]={['D']='Welcome to the Fey Sorceress\\' Pocket Realm. A nature-haven filled with glowing plants and crystals, brilliant constructions and bubbling concotions. Best enjoyed at night.',['N']='Fey Sorceress\\' Realm',['O']=19094,['C']=1.020000,},[79]={['D']='\"You are in the mind of a deranged cultist Doctor, obsessed with creating a minion worthy of his Master, for his awakening.\\r\\n\\r\\nThe further you delve into the Laboratory, the deeper you sink into his insanity. Can you escape it or will you too get smothered by the kiss of Cthulu?\"\\n\\n1st person and clear weather for window reflections adviced, for the best experience!\\n\\n1 hidden room, in the upper laboratory!',['N']='The Nightmare Lab',['O']=19841,['C']=1.038000,},},['Version']=1773,}"
