R["oh__@theimperfect"]="{['eu']={[65]={['N']='Dwarven Home',['O']=18733,},[2]={['C']=1.020000,['O']=19238,['D']='',['N']='Daggerfall Inn',},[68]={['N']='Rimmen Inn',['O']=18735,},[101]={['C']=1.051000,['O']=19826,['D']='Home of Hala Hlaalu, a dunmer merchant, diplomat and agent. ',['N']='Necrom City House',},[38]={['C']=1.021000,['O']=19217,['D']='Ancestral home of the Veron family. ',['N']='Daenia Dolmen Manor',},[7]={['N']='Black Vine House',['O']=18550,},[72]={['N']='Necromancer Lair',['O']=18576,},[41]={['N']='Craglorn Estate',['O']=18735,},[10]={['C']=1.051000,['O']=19547,['D']='Home of an Argonian sorceress',['N']='Dhalmora House',},[43]={['C']=1.021000,['O']=18878,['D']='Home of a Hlaalu trader and her retinue',['N']='Hlaalu Home',},[76]={['D']='Home of a Crown Redguard Dragonknight who is a Magnifica. \\nNot quite finished, need to add the new oven when it comes out later in the year and some items slots are left to add things here and there yet, but mostly done.',['O']=19800,['C']=1.051000,['N']='Bangkorai Oasis',},[45]={['C']=1.026000,['O']=19703,['D']='An argonian arcanist Telvanni lives here. Sharp as Night resides in his own place outside where there is a shared area that adventuring expeditions are discussed and planned in.',['N']='Telvanni Home',},[48]={['C']=1.051000,['O']=19337,['D']='This is the home of a nord woman called Langliva Lightbringer. She is a Meridia follower. The home will be finished eventually inside with the Celestial Nimbus furnishings when the Sovngarde crates come back so the interior is incomplete currently.',['N']='Falkreath Hall',},[82]={['C']=1.020000,['O']=19040,['D']='A half Reach/Breton womans home, she is married to Hroltar the Boaster for her sins.',['N']='Mage\\'s Pocket Realm',},[19]={['C']=1.051000,['O']=19453,['D']='Home of a nomadic Ashlander warden who resides here when passing through the area. The home was gifted to her.',['N']='Kragenmoor House',},[69]={['C']=1.051000,['O']=19386,['D']='',['N']='Riverhold Adeptorium',},[4]={['C']=1.051000,['O']=19237,['D']='',['N']='Skywatch Apartment',},[54]={['N']='Wrothgar Ruins',['O']=18595,},[23]={['O']=18750,['C']=1.021000,['N']='Rawl\\'kha House',},[36]={['C']=1.051000,['O']=19379,['D']='Home of a Redguard woman who sails and follows Dibella. ',['N']='Port Hunding House',},[92]={['C']=1.020000,['O']=19277,['D']='A Khajiit necromancer home but one where he can invite guests where it is not obvious that he is a necromancer. He has another home he keeps private for his necromantic studies.',['N']='Fargrave Manor',},[26]={['N']='Cyrodiil Gatehouse',['O']=18976,},[27]={['C']=1.051000,['O']=19483,['D']='The home of an Imperial woman of Tsaesci ancestry and ancestors from Akavir. She has a strong connection to nature.',['N']='Arenthia House',},[60]={['N']='Captain\\'s Grotto',['O']=18674,},[104]={['C']=1.051000,['O']=19712,['D']='Home of an Argonian Arcanist. Her main home is Tel Galen but she had to rise the ranks to become Telvanni and needed a place more formal and acceptable to meet (like mouths of other Telvanni) and associate with to climb ranks and so she made this her more formal public home.',['N']='Arcanist\\'s Hideaway',},[94]={['C']=1.026000,['O']=19695,['D']='Home of an Orcish Arcanist. She lives with Ghrasharog the armory assistant and Azander. Mizzik likes to pop in to discuss his investigations.',['N']='Coral Atoll',},[95]={['D']='Home of a half Breton and half Reach woman for when she visits the bay and goes sailing.',['O']=19716,['C']=1.051000,['N']='Gonfalon Bay Inn',},},['TS']=1713045897,['Version']=1773,['Key']='oh__@theimperfect',}"
