R["fx__na__@zorniekins__70"]="{['Effects']={[1]={['Y']=10670,['Pitch']=0,['SizeZ']=40,['Roll']=0,['Yaw']=5.235988,['SizeX']=260,['Id']=1026,['EffectType']=4401,['MetaData']={['message']='Nuzhimeh the Merchant',},['Z']=89401.158253,['Alpha']=1,['Groups']=0,['Contrast']=1,['SizeY']=40,['X']=105948.307162,['Color']=999998,},[2]={['Y']=10704,['Pitch']=0,['SizeZ']=40,['Roll']=0,['Yaw']=0.523599,['SizeX']=260,['Id']=1027,['EffectType']=4401,['MetaData']={['message']='Ezabi the Banker',},['Z']=87639.175922,['Alpha']=1,['Groups']=0,['Contrast']=1,['SizeY']=40,['X']=102683.761821,['Color']=999998,},[3]={['Y']=10722,['Pitch']=0,['SizeZ']=40,['Roll']=0,['Yaw']=4.014257,['SizeX']=220,['Id']=1028,['EffectType']=4401,['MetaData']={['message']='Giladil the Ragpicker',},['Z']=88963.920286,['Alpha']=1,['Groups']=0,['Contrast']=1,['SizeY']=40,['X']=106158.586281,['Color']=999999,},[4]={['Y']=10586,['Pitch']=5.668829,['SizeZ']=40,['Roll']=0,['Yaw']=0.478220,['SizeX']=33.456456,['Id']=1030,['EffectType']=8502,['MetaData']={['message']='The tales of the Lunar Champion echo through the corridors of time like the whispers of the moons themselves. Khunzar-ri - the great hero of old, once walked among mortals during the Merethic Era. It is said that he was blessed by Jone and Jode, imbued with their divine grace. Yet, as with all things, the sands of time eventually wear away even the mightiest monuments.\\n\\nAs the centuries passed, the once-grand hall fell into disrepair. Plague ravaged the land, and the political landscape of Elsweyr shifted. Once a bastion of hope, it became little more than a forgotten relic of a bygone era.\\n\\nIn the Second Era, with the rise of the Usurper Queen and the tightening grip of the law, the temple stood empty and abandoned. Its halls echoing with the ghosts of a lost age. Even in its dilapidated state, it retained a certain allure - a sense of mystery and intrigue that drew those of a less savory nature.\\n\\nIt was in this atmosphere of neglect and decay that the seeds of rebellion were sown. Whispers spread among the outcasts of Rimmen. Tales were told of a hidden sanctuary, a refuge for those who dared to defy the Usurper Queen and her unjust laws.\\n\\nAnd so, with the blessings of Rajhin, the Temple of Charity was born. No longer simply a place of worship, but a haven for protectors, warriors, and all manner of ne\\'er-do-wells. The once-hallowed halls now echoed with laughter and revelry.\\n\\nIn the shadows of the Usurper Queen\\'s rule, the Temple of Charity stood as a symbol of defiance - a testament to the indomitable spirit of the Khajiiti people. Though branded as outlaws by the powers that be, those who sought refuge found a sense of camaraderie that transcended societal boundaries, under the watchful eye of Khunzar-ri and the playful gaze of Rajhin.',['title']='A Brief History of Charity',},['Z']=90738.383716,['Alpha']=1,['Groups']=0,['Contrast']=1.250000,['SizeY']=40,['X']=105067.005858,['Color']=405598,},[5]={['Y']=11041,['Pitch']=1.570971,['SizeZ']=47,['Roll']=0,['Yaw']=4.712389,['SizeX']=35.456456,['Id']=1037,['EffectType']=8001,['MetaData']={['lore category']=3,['lore book']=73,['lore collection']=49,},['Z']=89260.790097,['Alpha']=1,['Groups']=0,['Contrast']=0.560000,['SizeY']=47,['X']=103192.598543,['Color']=264838,},[6]={['Y']=10677,['Pitch']=0,['SizeZ']=47,['Roll']=0,['Yaw']=5.148720,['SizeX']=46.456460,['Id']=1040,['EffectType']=8503,['MetaData']={['message']='In the ancient sands of Elsweyr, where Jone and Jode cast their silver light upon the land, there exists a temple dedicated to the great champion Khunzar-ri.\\n\\nOnce, it stood as a beacon of hope, its halls echoing with hymns of the faithful. But as time wore on, Tamriel changed - The temple fell into disrepair.\\n\\nRajhin - the Trickster God - chanced upon the forgotten temple. Drawn by whispers of mischief and the promise of unexpected treasures, Rajhin slipped through the shadows. There - among dust and sand - he found the Lunar Champion; his spirit lingering like a ghost in fading candle light.\\n\\nAt first, Zar regarded Rajhin with suspicion - the thief was known for his unpredictable nature. Though different as night and day, a mutual respect began to grew between the champion and trickster.\\n\\nRajhin regaled Zar with tales of his exploits and adventures, weaving a tapestry of laughter and merriment that danced upon the moonlight like scents of blooming jasmine. In return, Zar shared his wisdom and strength, offering Rajhin a glimpse into the noble heart that once beat within his chest.\\n\\nTogether, they watched as the temple was transformed from a once forgotten relic into a refuge for the outcast and downtrodden. Where once there had been only shadows, now there was light, and laughter, and the promise of redemption.\\n\\nSo it was that the Temple of Charity became a testament to the strange duality of Rajhin and Khunzar-ri - boon of the Trickster God along with the unwavering courage of the champion mingled like the colors of a desert sunset.\\n\\nThough their partnership was an unlikely one, it was a bond forged by the fires of adversity, and would endure for all eternity.\\n\\n* * *',['title']='Tale of Two Tails, Volume 1',},['Z']=88171.964050,['Alpha']=1,['Groups']=0,['Contrast']=0.750000,['SizeY']=47,['X']=103001.204520,['Color']=20216,},[7]={['Y']=10657,['Pitch']=1.570971,['SizeZ']=47,['Roll']=0,['Yaw']=4.886922,['SizeX']=46.456456,['Id']=1041,['EffectType']=8503,['MetaData']={['message']='As the winds of change swept through Elsweyr, rebellion stirred within the hearts of the people. The oppressive rule of Euraxia - the Usurper Queen - had cast a shadow over the land. The time had come for her reign of tyranny to end.\\n\\nRajhin and Khunzar-ri ever vigilant in their watch over the Temple of Charity sensed the clawing unrest. A plan was devised to bring an end to Euraxia\\'s iron-fisted rule and restore freedom to the people of Elsweyr.\\n\\nWith the caress of Jone and Jode\\'s light against their backs, they crept through the streets of Rimmen, silent as the grave.\\n\\nUpon walls of the palace sat siege weapons aimed at the town below. Their menacing presence a reminder of Euraxia\\'s threats. With a flick of his wrist and a pouch of firesalts Rajhin set them ablaze, flames licking hungrily into the night sky.\\n\\nThe commotion drew the attention of Euraxian guards, shouts ringing out into the dark. Seizing the opportunity, Rajhin and Khunzar-ri slipped past them, movements swift and sure.\\n\\nWithin the palace, they encountered Euraxia\\'s most powerful necromancer, an orc wielding the forbidden arts with reckless abandon. But against the combined might of Rajhin and Khunzar-ri, the necromancer stood no chance.\\nWith a flourish of his blade, Khunzar-ri struck the killing blow, sending the necromancer\\'s dark spirit screaming into the void.\\n\\nAt last, they reached the central courtyard, where Euraxia awaited them upon a raised platform. Eyes gleaming pure malice and a mocking smile, she taunted the duo, confident in her superiority.\\n\\n* * *',['title']='Tale of Two Tails, Volume 2',},['Z']=88191.703076,['Alpha']=1,['Groups']=0,['Contrast']=0.750000,['SizeY']=47,['X']=102965.900549,['Color']=40529,},[8]={['Y']=10660,['Pitch']=4.886922,['SizeZ']=47,['Roll']=0,['Yaw']=5.235988,['SizeX']=46.456456,['Id']=1042,['EffectType']=8503,['MetaData']={['message']='\\n* * *\\n\\nBut Rajhin and Khunzar-ri did not writhe. Forward they charged, steel outright. Euraxia\\'s guards fell before them like wheat before the scythe, their numbers no match for their righteous might.\\n\\nAt last, they stood face to face with Euraxia herself, the Usurper Queen who had brought so much suffering upon the land.\\nWith a defiant roar, Khunzar-ri leapt forward, his blade arcing through the air like a streak of lightning.\\n\\nEuraxia\\'s cruel smile died upon her lips as Khunzar-ri\\'s sword struck true, piercing her black heart and ending the reign of terror once and for all. As her lifeless body crumpled to the ground, a sense of peace settled over Elsweyr - the weight of tyranny lifted at last.\\n\\nAmidst the ruins of the palace, Rajhin and Khunzar-ri stood victorious. So long as they were united, no darkness could ever hope to extinguish the light of freedom and justice in the hearts of the Khajiiti people.\\n\\nAs dust settled in the wake of battle, silence fell over the courtyard. A figure emerged from the shadows - Khamira, the True Queen.\\n\\nWith a flourish of his hand, Rajhin produced the crown that had been stolen from Khamira so many moons ago, its golden gleam a symbol of her rightful authority.\\n\\nHer eyes shimmered with unshed tears as she accepted the crown from Rajhin\\'s outstretched paw. With a solemn nod, she placed it upon her brow, the weight of her responsibilities settling upon her shoulders like a mantle of stars.',['title']='Tale of Two Tails, Volume 3',},['Z']=88215.151313,['Alpha']=1,['Groups']=0,['Contrast']=0.680000,['SizeY']=47,['X']=102939.660707,['Color']=40529,},[9]={['Y']=10689,['Pitch']=4.799655,['SizeZ']=44,['Roll']=0,['Yaw']=2.094395,['SizeX']=32.456456,['Id']=1043,['EffectType']=8501,['MetaData']={['message']='B,\\nBy Jone and Jode, how many damn loaves of bread are you going to churn out? We\\'re not feeding an army here. Even just grilled bananas would be a relief from this plague of dough. Get some variety before this one starts pulling out her fur.\\n-V\\n\\n* * *\\n\\nBeen hearing your bellyaching since before the Mane had whiskers, but fine - I\\'ll add more variety. Just don\\'t expect gourmet meals on a beggar\\'s budget. Besides, my bread got plenty of moon-sugar - good for the running you\\'re oh so fond of, yes yes?\\n-B',['title']='note for the Cook',},['Z']=87861.728554,['Alpha']=0,['Groups']=0,['Contrast']=0.620000,['SizeY']=44,['X']=104464.364663,['Color']=92150,},},['TS']=1710280827,['Version']=1773,}"
