R["fx__na__@malderyn__43"]="{['Version']=1773,['TS']=1703991341,['Effects']={[1]={['SizeY']=100,['EffectType']=614,['Y']=0,['Yaw']=0,['X']=0,['Id']=1349,['Alpha']=1,['Contrast']=1,['Groups']=0,['Z']=0,['SizeZ']=100,['Color']=494949,['Pitch']=0,['SizeX']=100,['Roll']=0,},[2]={['Contrast']=1,['SizeY']=70,['Roll']=0,['Y']=12500,['Yaw']=3.738495,['MetaData']={['message']='By Sedrys Arathas, Antiquarian\\n\\nFew people know of the Clockwork City, and even fewer are aware of the strange little realm called the Brass Cathedral. Seemingly located just north of Vivec City, most scholars agree that the town is in fact a sort of pocket realm created with surroundings to mimic the appearance of Vvardenfell.\\n\\nIt is not known who is responsible for creating the town, but its existence has been dated to at least 2E 56, when a slave of House Dres reported stumbling upon an city \"with spires of bronze and trees of silver\". He was whipped when he failed to lead his masters to these purported riches. Since then, tales are occasionally told of the Cathedral by lost travelers claiming to have found a door in the wilderness, leading to the majestic city.\\n\\nThe architecture of the town appears similar to that of the Clockwork City, at least according to the handful of sources that we have describing the two. Some elements of traditional Great House architecture can be seen beneath the brass machinations, perhaps suggesting that this was an early prototype long forgotten by Sotha Sil. Its namesake cathedral is said to dominate the town, with a delicately wrought facade of gold and bronze unlike any temple in all of Tamriel.\\n\\nIn a previous treatise, I theorised that a mage well-versed in planar magicks might be able to discern the entrance to the hidden realm - getting inside, however, might be another challenge altogether. If the entrance is indeed a door as most accounts suggest, perhaps the rumoured Skeleton Key of Nocturnal might serve to open the way. Unfortunately, until I am able to get ahold of Divayth Fyr or book an appointment with a Daedric Prince, the mysteries of the Cathedral will have to wait.',['title']='The Brass Cathedral',},['Id']=1354,['Alpha']=0,['X']=47327.321317,['Groups']=0,['Z']=51490.779183,['SizeZ']=70,['Color']=102439,['Pitch']=5.323254,['SizeX']=46.456456,['EffectType']=8503,},[3]={['SizeY']=150000,['EffectType']=439,['Y']=1,['Yaw']=0,['X']=46086,['Id']=1387,['Alpha']=0.120000,['Contrast']=3.300000,['Groups']=0,['Z']=45934,['SizeZ']=150000,['Color']=977999,['Pitch']=0,['SizeX']=150000,['Roll']=0,},[4]={['SizeY']=100,['EffectType']=54,['Y']=0,['Yaw']=0,['Contrast']=2.840000,['Id']=1393,['Alpha']=0.250000,['X']=0,['Pitch']=0,['Z']=0,['SizeZ']=100,['Color']=43673,['Groups']=0,['SizeX']=100,['Roll']=0,},},}"
