R["oh__@kiyakotari"]="{['Key']='oh__@kiyakotari',['Version']=1773,['na']={[66]={['N']='Path of Risen Flame',['D']='Both training ground and temple for the fiery cult known as the Path of the Risen Flame, this defunct and now restored and Imperial arena is the home of the enigmatic vampire-founder of that cult, a woman who is said to have split her soul in two - or have suffered a split of her soul - at some point in the past, and to now inhabit two bodies. One is the vampire leader of the cult, and the other is a follower of Mehrunes Dagon who has over time shed her mortality and risen to the rank Valkynaz.',['C']=1.007000,['O']=19035,},[68]={['O']=18706,['N']='Sweet Mother Waits',},[5]={['O']=18422,['N']='The Infirmary',},[38]={['O']=19372,['N']='The Hollow\\'s Manor',},[7]={['O']=18546,['N']='The Haunted Villa',},[56]={['O']=18909,['N']='Duoillaume\\'s Refuge',},[13]={['O']=18422,['N']='Khouri\\'s Sanctuary',},[59]={['O']=18801,['N']='The Weaver\\'s Home',},[44]={['N']='Sahtee\\'s Chapel Home',['D']='This is the home and chapel-refuge of Fanik-Aziz-Xal-Sahtee, who serves as a spiritual advisor, healer, and guide for Saxhleel making the transition from the yoke of slavery to freedom. She is assisted in this work by a number of Argonians and non-Argonians, including a Dunmer abolitionist and a Khajiiti traveler who has stopped over to stay for a while.',['C']=1.007000,['O']=18966,},[77]={['N']='Black Sacrament',['O']=19581,},[62]={['O']=18424,['N']='Duoillaume\\'s Manor',},[15]={['N']='The Protected Grove',['D']='This house is now the dwelling place of a community composed mostly of werewolves, though there are some non-lycanthropes among them. Composed mostly of Bosmer, with a smattering of Nords, Orsimer, and Dunmer, and even a couple of Redguard and a lone Altmer among them, they are known as The Enclave, and live in this grove under the protection of one of their ancestors, a Bosmeri woman who has transcended mortality to become a creature tied closely to both nature and Meridia. ',['C']=1.007000,['O']=18966,},},['TS']=1691831574,}"
