R["fx__na__@turgenev__49"]="{['Version']=1773,['TS']=1679468756,['Effects']={[1]={['SizeY']=30,['Yaw']=6.105162,['MetaData']={['title']='A Message from Turg, and... The Salad  Golem?',['message']='For the judges and subsequent visitors to my Exorcised Witches\\' Cottage on PCNA, titled \"Mistaken Identity,\" welcome.\\n\\nSo, I was only made aware of what the Allen Award actually was in context of Loctavian\\'s execution of Chopped in ESO. It was 3am, and I was jamming in the house with other housing people, just wandering around, trying to figure out how to make an anvil, an ayleid sconce, a long ass red flower, a flaming Satan Chandelier, crows-on-a-steeeck, and half-doors from Craglorn into one, cohesive piece.\\n\\nSo, being tired, I started slapping things onto a chunk of Ivy I had in the house. Took a skull from the house. Started to get a humanoid shape out of it. As I worked, I explained why certain elements were added: Anvils for feet, bendy flora for legs, skewered pigeons for arms, a cow skull for a face complete with a burning crown thanks to that chandy; and then I added two huge hand-like luminescent coral to operate as hands.\\n\\nWe all kinda stared, and I sang, \"Salad Goleeeeeem!\" (See Presto\\'s \\'Salad Shooter\\' commercial from 1994 on Youtube for the exact tone of the song.)\\n\\nThus was wrought Salad Golem (goh-LEHM), the most Cruciferous Defender of Nirn against incursions from beyond.\\n\\n(See Next: \"Audio Log, Exhibit 89A\")',},['X']=61119.163645,['SizeZ']=30,['Z']=46724.323591,['Id']=1970,['Alpha']=1,['SizeX']=22,['Pitch']=4.872959,['Y']=10292,['Roll']=0,['Contrast']=1,['Color']=385599,['EffectType']=8502,['Groups']=0,},[2]={['SizeY']=30,['Yaw']=0.432842,['MetaData']={['title']='Audio Log, Exhibit 89A',['message']='(emergency klaxons)\\n\\n\"I can\\'t lock on, sir! The jumpship\\'s discharge is clouding our scan. From the bloom, the reactor housing is likely cracked. Survival unlikely-\"\\n\\n\"Confirmation, not supposition. Pull her ballistic trajectory and trace it. Vectors, Ensign. Do the math!\"\\n\\n\"Yes, sir. Tracing vector now.\"\\n\\n\"Good. Helm, take us in. We need line of sight to pull Commander S\\'itx out of the crash zone.\"\\n\\n\"Yes, sir. Engines to full. Gravity buffers at max. All hands, prepare for some chop-\"\\n\\n(violent cavitation from atmospheric impact)\\n\\n\"Some, Helm?!\"\\n\\n\"Sorry, sir. The atmo\\'s fluid drag is higher than anticipated. I feel her air now, sir. Full power at your discretion.\"\\n\\n\"Good. Navigation, full scan, S\\'itx won\\'t make it long in that radiation bloom-\"\\n\\n\"Found her, sir. Many life signs around the crash site. I-\"\\n\\n\"What, Nav? Helm, full throttle, emergency aerobrake authorized.\"\\n\\n\"Sir, I\\'m registering too many life signs at the site. I can\\'t focus her in this data slush. We should eyeball close-up and-\"\\n\\n\"Captain, Combat! Bogeys are back! ETA to intercept, nine seconds-\"\\n\\n\"Dammit! Engineering, prep for tractor, Nav\\'s call! Helm, defensive drift! Combat, weapons free!\"\\n\\n\"Focusing. Focusing. The life signs are REALLY muddled, sir-\"\\n\\n(combat audio: \"FUS RO DAH!\", heavy weapon discharge, distressed metal, screams)\\n\\n\"Dammit! Engineering! Go for a hot grab! Combat, status!\"\\n\\n\"Two bogeys down, sir! Two more trailing, ETA to intercept forty seconds and holding, they\\'re watching us-\"\\n\\n\"Finally. Nav! Final report!\"\\n\\n\"Locked, sir!\"\\n\\n\"Engineering! Bring S\\'itx home!\"\\n\\n(silence)\\n\\n\"Uh, Captain? Engineering here-\"\\n\\n\"Status! Did you get S\\'itx or not?\"\\n\\n\"Ah, well, that depends, sir- Was she wearing a saddle when she took off?\"',},['X']=61158.823166,['SizeZ']=30,['Z']=46726.583944,['Id']=1971,['Alpha']=1,['SizeX']=22,['Pitch']=4.872959,['Y']=10295,['Roll']=0,['Contrast']=1,['Color']=356499,['EffectType']=8502,['Groups']=0,},[3]={['SizeY']=353.492647,['Yaw']=0.349066,['MetaData']={['name']='Turgenev',['message']='Welcome. Please read these books. I hope you enjoy your time here.',},['X']=61086.762408,['SizeZ']=353.492647,['Z']=46625.438876,['Id']=1973,['Alpha']=1,['SizeX']=213.782383,['Pitch']=0,['Y']=10328,['Roll']=0,['Contrast']=0.630000,['Color']=276098,['EffectType']=5015,['Groups']=0,},[4]={['Yaw']=1.293289,['SizeY']=2200,['Roll']=0,['SizeZ']=2200,['Z']=48444.923322,['Id']=2009,['Alpha']=1,['SizeX']=102,['Pitch']=3.141767,['Y']=10504,['X']=63351.859006,['Contrast']=1,['Color']=999998,['EffectType']=4533,['Groups']=0,},},}"
