]={['Yaw']=5.040511,['Pitch']=1.483530,['EffectType']=8501,['MetaData']={['title']='A Mother\\'s Nursery Rhyme',['message']='Do you have five children, Mother?\\nI\\'ve heard that you do.\\nFive children? No, tonight I have four!\\nFour children, sweet and pure.\\nFour and no more!\\n\\nDo you have four children, Mother?\\nI\\'ve heard that you do.\\nFour children? No, tonight I have three!\\nThree children abed late today.\\nThree and no more!\\n\\nDo you have three children, Mother?\\nI\\'ve heard that you do.\\nThree children? No, tonight I have two!\\nTwo children, quiet and shy.\\nTwo and no more!\\n\\nDo you have two children, Mother?\\nI\\'ve heard that you do.\\nTwo children? No, tonight I have one!\\nOne child, singing a song.\\nOne and no more!\\n\\nDo you have one child, Mother?\\nI\\'ve heard that you do.\\nOne child? Please, I have none!\\nThey\\'re with their father now\\nAnd live here no more.',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=102439,['X']=78577.047029,['SizeY']=30,['SizeZ']=30,['Y']=50810,['Id']=1838,['Z']=114193.783226,['SizeX']=26.456456,},[45]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=1004,['MetaData']={['furniture']='4612199632093444297',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494948,['X']=81030.111878,['SizeY']=1000,['SizeZ']=1000,['Y']=50747,['Id']=1839,['Z']=114244.382290,['SizeX']=2200,},[46]={['Yaw']=2.256711,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Well met, stranger, and be welcome to the Black Halo. I may arise, now and then, to tell you a truth. Do not look for me. I will find you.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=81407,['SizeY']=220,['SizeZ']=220,['Y']=50709,['Id']=1841,['Z']=114699,['SizeX']=90.378378,},[47]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1841,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=81372,['SizeY']=1000,['SizeZ']=1