'target effect']=1849,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494949,['X']=83498.909013,['SizeY']=3000,['SizeZ']=3000,['Y']=50550,['Id']=1852,['Z']=110596.074733,['SizeX']=3000,},[55]={['Yaw']=4.239405,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Murder. Exquisite when executed with calm and precision. Abhorrent when muddled with emotion or absence of grace. The Brotherhood embraces this act as our own Sacrament: Each soul we sent to Sithis is a prayer, an act of worship.\\n\\nThe archways lead ...elsewhere. Where, I am not permitted to say.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=85708,['SizeY']=220,['SizeZ']=220,['Y']=50594,['Id']=1853,['Z']=113891,['SizeX']=90.378378,},[56]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1853,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=85708,['SizeY']=3000,['SizeZ']=3000,['Y']=50622,['Id']=1854,['Z']=113834,['SizeX']=3000,},[57]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1853,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494948,['X']=85774.747214,['SizeY']=1000,['SizeZ']=1000,['Y']=50503,['Id']=1855,['Z']=113945.070441,['SizeX']=3000,},[58]={['Yaw']=3.872886,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Magnificent, is it not? The Black Halo is unique amongst Sanctuaries - or any keep or citadel, for that matter. She glides amongst the Realms, to answer Black Sacraments wherever they may be. She may evade more than she fights, but make no mistake. The Black Halo has teeth. And the Eye of Sithis never, ever, shuts.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=95062.212830,['SizeY']=220,['SizeZ']=220,['Y']=52861,['Id']=1857,['Z']=114202.561834,['SizeX']=90.378378,},[59]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1857,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=94933.088842,['SizeY']=1000,['SizeZ']=1000,['Y']=52915,['Id']=1858,['Z']=114189.118761,['SizeX']=3000,},[60]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1857,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=95039.279003,['SizeY']=3000,['SizeZ']=3000,['Y']=52942,['Id']=1859,['Z']=114193.132512,['SizeX']=3000,},[61]={['Yaw']=4.319690,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='These chains... forged from Daedric iron. It was the only metal resilient enough to withstand the rigors of planar travel. When the Black Halo glides, the clatter of these chains trailing along the dirt and rock can deafen and unnerve any Daedric denizens within sight. A terrible but beneficial side effect, yes?',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=92707,['SizeY']=220,['SizeZ']=220,['Y']=50649,['Id']=1862,['Z']=113935,['SizeX']=90.378378,},[62]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1862,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=92788,['SizeY']=1000,['SizeZ']=1000,['Y']=50630,['Id']=1863,['Z']=113934,['SizeX']=3000,},[63]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1862,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=92740,['SizeY']=3000,['SizeZ']=3000,['Y']=50695,['Id']=1864,['Z']=113964,['SizeX']=3000,},[64]={['Yaw']=4.644321,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Every blade must be honed. Many Brothers and Sisters have whetted their edge against that mindless atronach, or even against each other in an honest duel. These arenas litter our favored anchors across Mundus and the darker, coarser planes.\\n\\nI wonder what the natives do in the stands when we\\'ve sailed on?',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=97903,['SizeY']=220,['SizeZ']=220,['Y']=49515,['Id']=1865,['Z']=114261,['SizeX']=90.378378,},[65]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1865,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=97914,['SizeY']=1000,['SizeZ']=1000,['Y']=49564,['Id']=1866,['Z']=114320,['SizeX']=3000,},[66]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1865,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=97932,['SizeY']=3000,['SizeZ']=3000,['Y']=49561,['Id']=1867,['Z']=114316,['SizeX']=3000,},[67]={['Yaw']=2.939134,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='...I may not approach any closer. He will not suffer my presence. And I have grown rather fond of this aetheric existence, yes? ...The Dread Father will test you. Your goals. Your memories, perhaps.\\n\\nRemember your training, and whom you serve.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=101307,['SizeY']=220,['SizeZ']=220,['Y']=49498,['Id']=1868,['Z']=111088,['SizeX']=90.378378,},[68]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1868,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=101322,['SizeY']=1000,['SizeZ']=1000,['Y']=49538,['Id']=1869,['Z']=111061,['SizeX']=3000,},[69]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1868,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=101338,['SizeY']=3000,['SizeZ']=3000,['Y']=49575,['Id']=1870,['Z']=111208,['SizeX']=3000,},[70]={['Yaw']=3.677409,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Like any bird of prey, the Black Halo\\'s bones are hollow. This is one of several ingress avenues where you may find our supplies, weapons stores, siege engines... The Halo may be lean, but her skin hides fierce muscle.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=102313.828203,['SizeY']=220,['SizeZ']=220,['Y']=53254,['Id']=1871,['Z']=114398.198796,['SizeX']=90.378378,},[71]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1871,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=102356.614913,['SizeY']=1000,['SizeZ']=1000,['Y']=53315,['Id']=1872,['Z']=114416.981647,['SizeX']=3000,},[72]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1871,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=102195.242535,['SizeY']=3000,['SizeZ']=3000,['Y']=53342,['Id']=1873,['Z']=114333.168372,['SizeX']=3000,},[73]={['Yaw']=5.237733,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='The Throne of the Listener, and of his servants, the Speakers. The raw opulence can be jarring, perhaps? But when facing the Lords and Ladies of the Void, every measure of strength and potency must be shown, like a peacock\\'s feathers. Lest they lust too wildly for our riches.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=106365.400625,['SizeY']=220,['SizeZ']=220,['Y']=53279,['Id']=1874,['Z']=113947.134216,['SizeX']=90.378378,},[74]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1874,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=106339.334646,['SizeY']=1000,['SizeZ']=1000,['Y']=53315,['Id']=1875,['Z']=113929.991983,['SizeX']=3000,},[75]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1874,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=106341.447874,['SizeY']=3000,['SizeZ']=3000,['Y']=53342,['Id']=1876,['Z']=113951.792899,['SizeX']=3000,},[76]={['Yaw']=3.672173,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='These quiet gardens offer the Brotherhood several benefits. Some bear the fruit of poison, or of healing. Others may offer more mystical or esoteric properties. And yet others are here for their quiet beauty and grace. The Brotherhood is nothing if not multi-faceted in our designs.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=101892,['SizeY']=220,['SizeZ']=220,['Y']=52847,['Id']=1877,['Z']=106985,['SizeX']=90.378378,},[77]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1877,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=101890,['SizeY']=3000,['SizeZ']=3000,['Y']=52913,['Id']=1878,['Z']=106983,['SizeX']=3000,},[78]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1877,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=101749,['SizeY']=1000,['SizeZ']=1000,['Y']=52833,['Id']=1879,['Z']=106975,['SizeX']=3000,},[79]={['Yaw']=3.822271,['Pitch']=0,['EffectType']=5079,['MetaData']={['message']='Lovely, is she not? A fine Imperial Sister of the First Era... Scipia, if I recall? She was an accomplished knight of some forgotten Order. She brought to heel the wild nations that irritated the Emperor, before leaving it all behind for love of murder. Her statue still stands in the Imperial City, its lords and ladies unaware of her devotion to the Void. She was magnificent.',['name']='Red Shadow',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=60099,['X']=102152,['SizeY']=220,['SizeZ']=220,['Y']=52849,['Id']=1880,['Z']=120836,['SizeX']=90.378378,},[80]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=934,['MetaData']={['target effect']=1880,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=102128.855292,['SizeY']=1000,['SizeZ']=1000,['Y']=52918,['Id']=1881,['Z']=120817.821299,['SizeX']=3000,},[81]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={['target effect']=1880,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=102183.962559,['SizeY']=3000,['SizeZ']=3000,['Y']=52823,['Id']=1882,['Z']=120875.773968,['SizeX']=3000,},[82]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=1004,['MetaData']={['furniture']='4612199632093531693',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=104817.680911,['SizeY']=1000,['SizeZ']=1000,['Y']=53326,['Id']=1883,['Z']=114124.343606,['SizeX']=2200,},[83]={['Yaw']=0,['Pitch']=0,['EffectType']=263,['MetaData']={['offset % (y)']=0,['offset % (x)']=0,['scale % (y)']=100,['scale % (x)']=100,},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=999999,['X']=105591.139685,['SizeY']=386,['SizeZ']=386,['Y']=52599,['Id']=1887,['Z']=114905.030075,['SizeX']=317,},[84]={['Yaw']=0,['Pitch']=0,['EffectType']=1010,['MetaData']={['then group furniture']='4612199632093575290,4612199632091914340,4612199632093575286,4612199632093575287,4612199632093575289,4612199632091911219,4612199632093575292',['when furniture']='4612199632091911219',['is']='Off',['will be']='Off',['then group']='Altar Candles',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=999998,['X']=104734.673929,['SizeY']=1,['SizeZ']=1,['Y']=49150,['Id']=1888,['Z']=116833.893354,['SizeX']=1,},[85]={['Yaw']=3.752458,['Pitch']=5.846853,['EffectType']=8503,['MetaData']={['title']='A Word from the Author (please read)',['message']='- Ajencia, On Rumor and Investigation\\n\\n\"Since the days the Vestige joined the Dark Brotherhood, the assassin\\'s guild has answered Black Sacraments from all across Tamriel and even the planes of Oblivion. To facilitate their explosive expansion, the Sanctuaries banded together to erect, with mortar and with magick, a nomadic citadel. \\n\\n\"Not tethered to the earth, it glides silently upon the extraplanar winds of opportunity. Its blessed purpose: to further the will of the Night Mother and their Dread Father, Sithis.\\n\\n\"To reap souls.\\n\\n\"To feed the Void.\\n\\n\"They named this silent fortress Black Halo.\"\\n\\n\\n\\nWelcome to the Black Halo.\\n\\nIt is themed on the Dark Brotherhood, after the Vestige had joined their ranks. Business is booming, and the Night Mother has not disappointed those who\\'ve prayed their Black Sacrament, even across the planes. You will find a small homage to her as you enter. There are two. Turn around.\\n\\nAs divine assassins, they develop a murderous thirst. Thus, there is a bar named \"The Rusty Stiletto\" near the entrance. Enjoy the view, and the ale.\\n\\nRemember, the flavor of fear is sublime, O my Brothers.\\n\\nThere are two easter eggs. Look for two special ballista platforms. There is a door on each. One is serious. The other, smouldering.\\n\\nSince you have EHT, you may see a specific script for the Sithis statue. To complete it fully, I must be present (mechanics, word trigger). Without me, it\\'s a small, nice light show. Not an important script, but if you\\'d like to experience it, msg me @Turgenev and I\\'ll be happy to demo. NOTE: You will die, but it will be thematic.\\n\\nYour guide is Red Shadow, a late assassin who teeters on the verbose...\\n\\nMany thanks to @DarkRapture1313 for her floral adeptness.\\n\\nEnjoy your visit, and thank you for coming.\\n\\n-T.',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=997330,['X']=79607.965455,['SizeY']=50,['SizeZ']=50,['Y']=50980,['Id']=1889,['Z']=114305.135128,['SizeX']=46.456456,},[86]={['Y']=50971,['Pitch']=1.047198,['Alpha']=1,['EffectType']=72,['Color']=991337,['Groups']=0,['Roll']=0,['Contrast']=1,['X']=79620.320552,['SizeY']=1,['Yaw']=3.577925,['SizeZ']=200,['Id']=1892,['Z']=114324.906043,['SizeX']=200,},[87]={['Yaw']=4.712389,['Pitch']=0,['EffectType']=993,['MetaData']={['furniture']='4612199632093570203',},['Alpha']=1,['Contrast']=1,['Groups']=0,['Roll']=0,['Color']=494947,['X']=106340.180056,['SizeY']=1200,['SizeZ']=1200,['Y']=49039,['Id']=1894,['Z']=113944.462528,['SizeX']=2000,},[88]={['Yaw']=1.570796,['Pitch']=0,['EffectType']=914,['MetaData']={[