R["oh__@nyght.raven"]="{['na']={[32]={['N']='Shady Business?',['O']=18830,['D']='Everyone knows that any successful illegal venture needs a good, solid front to keep the funds flowing and keep those nosy guards out of the way. Visit with the legit merchants up front or find your way through the secret passage and tunnel to the shadier side of business. ',['C']=1.007000,},[34]={['N']='A Mercenary\\'s Refuge',['O']=18830,['D']='A simple place to call home when a mercenary gets tired of life on the road. ',['C']=1.051000,},[37]={['N']='Safe Haven Inn',['O']=18854,['D']='Run by an elderly Khajiit and her Argonian partner, both of whom were themselves former slaves, this modest Inn serves as a waystation, a safe haven for newly rescued slaves. It gives them a place to rest, and be tended to before being helped on the way back to their homes, or to a new one where they can live free and happy again. ',['C']=1.007000,},[6]={['N']='Remembering the Past',['O']=18854,['D']='A Dunmeri shrine to honor the ancestors, as well as a peaceful spot to just sit and remember the past. ',['C']=1.051000,},[7]={['N']='We\\'re All Mad Here',['O']=18830,['D']='Mad? Surely not. Just a normal day in the life of a follower of Sheogorath. Just don\\'t try to eat the cheese! ',['C']=1.026000,},[72]={['N']='Abandon All Hope',['O']=18830,['D']='This is the domain of the necromancer vampire Xarenthos Silverthorn. He rules his world with iron claws, having no mercy for any who dare to challenge his position of power. ',['C']=1.023000,},[9]={['N']='Oaths of Blood',['O']=18830,['D']='Rp-wise, this home is actually connected to Wraithhome, and serves as the main home for Xarenthos\\' most loyal minion, an Argonian vampire necromancer named Hajxul. ',['C']=1.023000,},[10]={['N']='Quiet Serenity',['O']=18830,['D']='A quiet garden spot to relax and take your mind off the day\\'s troubles. ',['C']=1.021000,},[43]={['N']='Dunmergonian Home',['O']=18830,['D']='Raised by Argonians after having been abandoned as a child in the Black Marsh, this Dunmer finds comfort in blending his love of the Argonian style with more traditional Dunmeri elements in his home. ',['C']=1.051000,},[44]={['N']='Ashlander Camp',['O']=18830,['D']='Secluded and sheltered camp for a couple of Ashlanders who sought out a respite from the rest of their tribe.',['C']=1.021000,},[13]={['N']='Bosmer Vampire Cave',['O']=18830,['D']='Simple refuge home for a Bosmer vampire. ',['C']=1.007000,},[46]={['N']='Love\\'s Dream',['O']=18848,['D']='A treasured garden to offer a place of peace and tranquility, a safe space for all who need it. (Please be sure to read the custom book to get the full story.) ',['C']=1.021000,},[47]={['N']='Step Beyond Reality',['O']=18830,['D']='Small pocket realm created by Khenarthi to serve as the home for a faithful Khajiiti monk named Sinasha\\'dro after a series of mysterious events led to his exile from Nirn. ',['C']=1.043000,},[17]={['N']='Sleepy Cat Inn',['O']=18830,['D']='Simple tavern catering to the weary traveler. Come and rest awhile, eat and drink, and share your tales with other travelers. ',['C']=1.007000,},[5]={['N']='Grandfather\\'s Legacy',['O']=18859,['D']='A young Redguard\\'s tribute to his beloved Grandfather. (look for the two books that tell more of the story)',['C']=1.029000,},[19]={['N']='Dark Arts Shop',['O']=18830,['D']='Dunmeri owned and operated, a place to find all you might need for any spell or ritual, or sacrifice? One can never be too careful when seeking the best possible ingredients. ',['C']=1.007000,},[14]={['N']='Forgotten Grotto',['O']=18830,['D']='Long forgotten enchanted grotto lost deep in the darkest heart of Valenwood. This mysterious place has been left to grow untended, and who knows what secrets may lurk in the shadows or behind the sealed door. ',['C']=1.020000,},[15]={['N']='Mossmoon Clan Home',['O']=18830,['D']='Once home to a Bosmer Spinner and her husband, this lush estate now belongs to her twin children who inherited it after their parents\\' death. They were looked after by their Uncle until they were old enough to take care of the place on their own. The Union trellis tree was planted as a quiet but beautiful memorial to their parents and the love they shared. ',['C']=1.051000,},[40]={['N']='Hist Haven Village',['O']=18830,['D']='Originally founded by escaped Argonian slaves, Hist Haven now serves as a safe waypoint for others. The village has grown and continues to thrive, providing a home or temporary respite to newly freed slaves. If you visit, don\\'t forget to leave tribute at the Gryphon\\'s nest. ',['C']=1.041000,},[59]={['N']='Quiet City Home',['O']=18830,['D']='Having retired from a long life of service as a diplomat and battlemage, an Altmer has found a quiet home to settle down in and relax, including a studio for his artistic hobbies. ',['C']=1.007000,},[56]={['N']='Blackreach Sanctuary',['O']=18830,['D']='Set at the edge of Blackreach, this Dark Brotherhood sanctuary offers traveling assassins all the comforts of home. A safe place to stop over and rest, then reprovision yourself before moving on to the next contract. Don\\'t forget to give your regards to Night Mother and Sithis. ',['C']=1.007000,},[25]={['N']='Maormer Exile\\'s Home',['O']=18830,['D']='Left behind after being badly injured in a raid, a Maormer stormmage and sea captain finds himself exiled from the world he once knew and now  tries to find a new place for himself. His home holds many reminders of his true love, the sea, though he knows he can\\'t ever go home, it will always be a part of his life. ',['C']=1.051000,},[26]={['N']='The Merman\\'s Libary',['O']=18830,['D']='An ancient ruin sunken below the sea. It has been reclaimed by a scholarly merman who uses the space to hold his collection of enchanted, waterproof books, amidst other scattered treasures from ages past. ',['C']=1.020000,},[27]={['N']='Peryite PlagueHall',['O']=18830,['D']='Abandoned estate taken over by faithful followers of the Taskmaster himself. It now serves as a proud Plaguehall to honor Peryite in all his pestilent glory.',['C']=1.026000,},[60]={['N']='Jode\\'s Claws Port',['O']=18830,['D']='Home port to the Jode\\'s Claws, a ship crewed by a band of noble pirates and their dashing Khajiiti Captain. Always ready to set sail on their next adventure, or maybe searching for a few shinies, yes? ',['C']=1.007000,},[29]={['N']='Vampire\\'s Library',['O']=18830,['D']='Home to a vampire, once a Breton noble, he\\'s still accustomed to the finer things. ',['C']=1.007000,},[71]={['N']='LOTR Tribute',['O']=18830,['D']='My attempt to represent Rivendell and the Grey Haven, just a little something built out of my love for LOTR.  There\\'s also a little scene easteregg of sorts if you find it :) ',['C']=1.020000,},[31]={['N']='Dungeon Cell',['O']=18830,['D']='A dungeon cell deep within the domain of Xarenthos Silverthorn. RP-wise, it is connected to my Wraithhome.',['C']=1.023000,},},['Key']='oh__@nyght.raven',['TS']=1664518345,['Version']=1769,}"
