R["fx__na__@jarograv__18"]="{['TS']=1663719818,['Effects']={[1]={['MetaData']={['message']='One day the children of the People came to Abba Arl and asked, \"Who are our parents?\"\\nAbba Arl replied, \"The People have not two parents but four, and they are as follows. The great Dragon of Time, who set the stars in their courses and appointed the guardians to watch over the world. The Mother Serpent in the curve of whose back the world rests. The Fat Mother who nourished the People when they were lost and starving. And the Ox who bears the People on his back to their final rest. Many tales tell the story of the four parents.\" ...',['name']='Tales of Abba Arl: The Ox\\'s Tale',},['SizeZ']=235,['SizeX']=90,['Yaw']=4.712389,['Y']=8901,['SizeY']=235,['Alpha']=1,['Pitch']=0,['Color']=696969,['EffectType']=5010,['X']=68588.918187,['Z']=73099.860812,['Groups']=0,['Contrast']=1,['Id']=1418,['Roll']=0,},[2]={['SizeZ']=102,['SizeX']=100,['Yaw']=0.055851,['Y']=7960,['SizeY']=102,['Alpha']=1,['Z']=73766.055413,['Color']=6,['EffectType']=30,['X']=67324.855349,['Groups']=0,['Roll']=0,['Contrast']=4,['Id']=1423,['Pitch']=1.570971,},},['Version']=1769,}"
R["fx__na__@malderyn__83"]="{['Effects']={[1]={['EffectType']=8503,['Pitch']=0,['Z']=63392.662976,['Groups']=0,['Color']=102439,['Roll']=0,['Yaw']=0.898845,['MetaData']={['title']='The Realms in Exile',['message']='The leaders of the Faithful, Elendil and his sons, escaped from the Downfall with nine ships, bearing a seedling of Nimloth and the Seven Seeing-stones; and they were borne on the wind of a great storm and cast upon the shores of Middle-Earth. There they established in the North-west the Númenorean realms in exile, Arnor and Gondor. Elendil was the High King and dwelt in the North at Annúminas, and the rule in the South was committed to his sons, Isildur and Anarion.\\n\\nThe chief city of this southern realm was Osgiliath, through the midst of which flowed the the Great River Anduin from the falls of Rauros. There was set side by side the two thrones of Isildur and Anárion, who shared the realm between them. Eastward they built Minas Ithil, the Tower of the Rising Moon, and in the West was built Minas Anor, the Tower of the Setting Sun.\\n\\nUnder the rule of the heirs of Anárion, Gondor prospered for many hundreds of years.\\n\\nIn the year 2002, the Witch-King, chief of the Nazgûl, gathered his strength and struck at the stronghold of Minas Ithil, capturing the city and taking the Palantir from the tower. Thus did Minas Ithil come to be known as Minas Morgul, the Tower of Sorcery. Minas Anor, too, was named anew: Minas Tirith, the Tower of Guard - a city now ever watchful against the evil in the East.\\n\\nWhen King Eärnur received the crown in 2043, the Witch-King of Minas Morgul challenged him twice to single combat. Against all counsel, the King in his wrath rode with a small escort of knights to the gate of Minas Morgul. None of that riding were ever heard of again.\\n\\nAnd so it was that the line of Kings was broken, and the rulership of Gondor passed into the hands of the Stewards, until such time as a King shall return.',},['SizeY']=630,['Contrast']=1,['X']=29048.709291,['Id']=1377,['SizeZ']=630,['Alpha']=1,['Y']=50407,['SizeX']=1066.456456,},[2]={['EffectType']=8503,['Pitch']=0,['Z']=64801.342480,['Groups']=0,['Color']=102439,['Roll']=0,['Yaw']=2.731440,['MetaData']={['title']='The Downfall of Númenor',['message']='As a reward for their sufferings in the war against Morgoth, the Valar granted to the Edain a land to dwell in, far removed from the dangers of Middle-Earth. And thus on the Isle of Elenna, westernmost of all mortal lands, they founded the realm of Númenor.\\n\\nOnly one command had been laid upon the Númenoreans - they were forbidden to sail West out of sight of their own shores, or to attempt to set foot on the Undying Lands.\\n\\nThe realm of Númenor endured to the end of the Second Age and increased ever in power and splendour, and until half the Age had passed the Númenoreans grew also in wisdom and joy. The Númenoreans had now become great mariners, exploring all seas eastward; but they began to yearn for the West and envied the immortality of the Eldar. Ar-Pharazon the Golden was the proudest and most powerful of all the Kings, and no less than the kingship of the world was his desire.\\n\\nHe resolved to claim supremacy over Middle-Earth, and at length he humbled Sauron the Great and carried him back as a prisoner to Númenor. But Sauron lied to the King, declaring that everlasting life would be his when he possessed the Undying Lands, and the King listened to his counsel. And so it came that Ar-Pharazon and his great army sailed West and set foot upon the blessed shores of the Undying Lands.\\n\\nIt was in this hour of strife that the Valar laid down their guardianship and called upon the aid of the Creator Iluvatar. A great chasm was opened in the sea, and all the fleets of the Númenoreans were drawn down into the abyss, and they were drowned and swallowed up forever. On the island a sudden fire burst from the peak of the Meneltarma, and there came a mighty wind and a tumult of the ea