R["fx__eu__@p0s3id0n78__47"]="{['Version']=1769,['TS']=1662908020,['Effects']={[1]={['Contrast']=1,['Alpha']=1,['SizeX']=110.378378,['Yaw']=3.141593,['SizeY']=340,['Pitch']=6.195919,['EffectType']=5079,['Y']=36946,['X']=82553.745006,['Id']=1059,['Roll']=0,['SizeZ']=340,['Color']=999999,['MetaData']={['name']='Emma.98',['message']='Dear Visitor, I would like to invite you to my castle in exchange for the Tamriel secrets as I have heard that you are the most qualified. Please make your way to the Hollow City where you will be picked up by my trusted servant Henry. Please do not be in fear of  his darkness my child, we mean no harm, the only thirst I have is the thirst for knowledge. My castle is hidden beneath the Coldharbour island away from prying eyes. Some soles have tried to access my castle without an invitation but failed. The evidence of which can be seen near the entrance to the cave. A few words about me, I like chemistry and chess but I hate Tales of Tribute. I occasionally, have  some students over helping me with my experiments, as it can get lonely . My aim is to produce a blood that will give me a boost of strength and invisibility. For my children of the night, with whom I love to play, despite my age of 1666, I have built a hidden city beneath Coldharbour island not yet seen by human eyes. The castle itself is not a big place especially as I am the only soul occupying the residence, so I do not require lots of space.  Anyway I hope to see you soon. Best Regards Count Dracula signed with 3 drops of blood.',},['Z']=84244.457664,['Groups']=0,},[2]={['Contrast']=1,['Alpha']=1,['SizeX']=180,['Yaw']=3.228859,['SizeY']=40,['Pitch']=0.261799,['EffectType']=4407,['Y']=37091,['X']=82697.029056,['Id']=1060,['Roll']=0,['SizeZ']=40,['Color']=99,['MetaData']={['message']='Please Read :)',},['Z']=84243.124492,['Groups']=0,},[3]={['Groups']=0,['SizeY']=60,['Alpha']=1,['Y']=37067,['MetaData']={['message']='Please Keep the Door Closed!',},['Pitch']=0,['SizeZ']=60,['Color']=99,['X']=81815,['Id']=1061,['Roll']=0,['EffectType']=4407,['Yaw']=1.483530,['SizeX']=620,['Z']=84116,['Contrast']=1,},},}"
