R["fx__eu__@alicevalkyri__38"]="{['Effects']={[1]={['Roll']=0,['Y']=4698,['Alpha']=0,['Yaw']=3.577925,['Contrast']=1,['Color']=102439,['X']=96409.154333,['MetaData']={['title']='|c870d0dDark Ledger|r',['message']='(In this dark, leather-bound tome you find names and descriptions appearing on the pages as you flip through them, written in blood.)\\n\\n\\n\\n\\n\\n|cac1616Contract I|r\\n|c000000 Ouard Guegan.|r\\n\\n|cac1616Contract II|r\\n|c000000 There is someone loudly complaining that Evermore Castle smells of dog shit. I suppose someone must have taken great offense to his words for that. Great enough to call on a servant of shadows.|r\\n\\n|cac1616Contract III|r\\n|c000000 There is a dunmer in Wrothgar in need of a good purging. Show him the will of Sithis.  |r\\n\\n\\n\\n\\n\\n\\n\\n\\n                      |t150:150:esoui/art/icons/rep_darkbrotherhood_64.dds|t\\n\\n\\n\\n\\n\\n|cac1616Contract IV|r\\n|c000000 A powerful necromancer is trying to raise all the dead that are buried on the island in Glenumbra. I am fairly certain he is part of the Bloodthorn Cult. Make him fail and bring me back his notes.|r\\n\\n|cac1616Contract V|r\\n|c000000 Archmaster Siniel resides in a Crypt in Rivenspire. He is another necromancer that is going to cause a lot of trouble, see to it that you end him before he destroys all of Rivenspire with his madness.|r\\n',},['Z']=59583.379804,['SizeY']=66,['Groups']=0,['Pitch']=5.141740,['Id']=1047,['SizeZ']=66,['EffectType']=8503,['SizeX']=46.456456,},[2]={['Y']=5288,['Id']=1060,['Contrast']=1.340000,['Roll']=0,['Color']=295209,['X']=95573.131730,['Yaw']=0,['Z']=59340.334075,['SizeY']=1000,['Groups']=0,['SizeZ']=1000,['Pitch']=0,['EffectType']=28,['Alpha']=0.750000,['SizeX']=1000,},[3]={['Y']=5299,['Id']=1061,['Contrast']=1.300000,['Roll']=0,['Color']=695699,['X']=95572.093619,['Yaw']=1.570796,['Z']=59327.471015,['SizeY']=1300,['Groups']=0,['SizeZ']=1300,['Pitch']=0,['EffectType']=27,['Alpha']=0.690000,['SizeX']=1200,},[4]={['Y']=5291,['