R["oh__@ladyarcana"]="{['TS']=1657826967,['Key']='oh__@ladyarcana',['eu']={[82]={['D']='When Shalidor was kicked out of his magical pocket plan for tax evasion, I bought his tower on the cheap and moved in with my Nocturnal statue. Stunning views of the all-devouring abyss and the northern lights. My dog likes it very much. True, from Shalidor there remained a crazy clown, with knives, whom I cannot expel, he lives in the yard near the coast on a social program.',['C']=1.021000,['N']='Карманный план мага',['O']=19182,},[35]={['D']='Welcome to the home of hedonism! Striptease club with a bar and excellent cuisine, with the blessing of Vermina.',['C']=1.007000,['N']='Striptease club',['O']=19187,},[70]={['D']='Dvemer Vault of artefacts. Here we have living loft zone, vault in the portal, a bar \"The dead dog\\'s lare\" and a mistic pool downstairs the waterfall/',['C']=1.011000,['N']='Dwemer Vault',['O']=18820,},[39]={['D']='',['C']=1.021000,['N']='Sheo\\'s PartyHouse',['O']=18931,},[90]={['D']='One day, free efreets got together and squeezed a piece of a pocket plan from Mehrunes Dagon for development. Thus, the Temple of Fire was born. Fire symbolizes both life and death. You can ask for the blessing of wealth from the elements, find a haven for your dead and share a feast at the throne of God - Ifrit. Don\\'t forget to drink some water from the fountain of life.',['C']=1.037000,['N']='Temple of Fire',['O']=19183,},[59]={['D']='',['C']=1.030000,['N']='The Runway Museum',['O']=18921,},[7]={['D']='',['C']=1.007000,['N']='Potter\\'s workshop',['O']=19187,},[38]={['D']='Clockwork Veterinary Clinic.',['C']=1.027000,['N']='Clockwork Veterinary',['O']=19186,},[47]={['D']='',['C']=1.021000,['N']='LOFT',['O']=18921,},},['Version']=1769,}"
