R["fx__na__@nyght.raven__5"]="{['Version']=1757,['TS']=1629562392,['Effects']={[1]={['Alpha']=1,['EffectType']=8503,['Z']=26342.099635,['SizeZ']=30,['Groups']=0,['SizeX']=26.456456,['Y']=20201,['MetaData']={['message']='Az\\'arden is a Redguard. When he was four, his father was killed in battle. His mother sent him to stay with his grandfather who would also begin his training as a warrior. Descended from a long, prestigious line of Dragonguards and Swordmasters, his grandfather was a strict teacher but showed great pride in how well Az\\'arden learned new skills. The young Redguard took his training very seriously, and over time he and his grandfather grew very close. \\n\\n\\n\\nWhen Az\\'arden was sixteen, his world was turned upside-down. His cherished grandfather had been murdered, and worst of all, the teen was the one accused of the horrible deed. \\n\\n\\n\\nSuddenly facing the threat of execution for a crime he didn\\'t commit, and with no one to speak on his behalf, Az\\'arden fled. For the remainder of his teen years and into early adulthood, he roamed Tamriel, seeking whatever work would keep him fed. As he grew older and gained further skills and experience, he began taking jobs as a mercenary and sometimes took a place among the crews of privateer ships. \\n\\n',['title']='Grandfather\\'s Legacy Part 1',},['Pitch']=4.712564,['Contrast']=2.420000,['Id']=1104,['SizeY']=30,['X']=25378.314350,['Color']=92339,['Roll']=0,['Yaw']=3.153810,},[2]={['Alpha']=1,['EffectType']=8503,['Z']=26343.242979,['SizeZ']=30,['Groups']=0,['SizeX']=26.456456,['Y']=20201,['MetaData']={['message']='He never stopped searching, however, for the clues that would offer him the chance to discover the truth behind his grandfather\\'s murder. Eventually, he would find the clues he needed to bring the real killer to justice, and clear his own name. Once more, he would be able to set foot in his beloved homeland without fear. \\n\\n\\n\\nWanting to honor and to make amends to his grandfather\\'s spirit, Az\\'arden sought to build a tomb and shrine befitting the elder Redguard. It is decorated with items belonging to his grandfather and the family, as well as a few treasures he has acquired during his travels. He has also placed appropriate offerings, hoping to appease his grandfather\\'s spirit, to grant him the closure needed to be at peace. His last offerings are particularly personal, a letter written to his grandfather, and the skull and empty sword scabbard of the person who murdered his grandfather. \\n\\n\\n\\nIt is a place of honor, and respect, to celebrate the life of an accomplished and distinguished warrior, a fitting final resting place for a beloved ancestor. \\n\\n',['title']='Grandfather\\'s Legacy Part 2',},['Pitch']=4.712564,['Contrast']=2.200000,['Id']=1105,['SizeY']=30,['X']=25329.847907,['Color']=193275,['Roll']=0,['Yaw']=3.153810,},},}"
