er this for a lark. I\\'m ending this LARP right now. The fabricant can find its own way back to the Clockwork City. I\\'m grabbing a brew downstairs.\\n\\n- Smithers, the phenomonally talented roleplaying bantam guar',['title']='Captain Smithers\\' Log',},},[6]={['Y']=21187,['SizeZ']=200,['SizeY']=1,['Color']=29900,['Roll']=0,['Contrast']=1,['Id']=1922,['Z']=24729.810036,['Pitch']=1.308997,['X']=26713.932325,['Groups']=0,['Alpha']=1,['SizeX']=200,['Yaw']=1.494002,['EffectType']=72,},},['TS']=1644616557,}"
