Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=677,['Y']=9845,['Color']=999999,['Z']=85425,['X']=76037,['SizeY']=687,},[4]={['Yaw']=2.024582,['SizeX']=880,['Id']=1006,['SizeZ']=687,['Alpha']=1,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=133,['Y']=9843,['Color']=999999,['Z']=85144,['X']=75844,['SizeY']=687,},[5]={['Yaw']=0,['SizeX']=1500,['Id']=1007,['SizeZ']=1500,['Alpha']=0.750000,['Pitch']=0,['Roll']=0,['Contrast']=1.860000,['Groups']=0,['EffectType']=25,['Y']=11434,['Color']=450610,['Z']=73649,['X']=80567,['SizeY']=1,},[6]={['Yaw']=3.143338,['SizeX']=1514,['Id']=1080,['SizeZ']=1514,['Alpha']=1,['Pitch']=4.712564,['Roll']=0,['Contrast']=0.820000,['Groups']=0,['EffectType']=5044,['Y']=11449,['Color']=653019,['Z']=92023,['X']=78690,['SizeY']=1514,},[7]={['Yaw']=5.323254,['SizeX']=1100,['Id']=1020,['SizeZ']=1100,['Alpha']=1,['Pitch']=0,['Roll']=0,['Contrast']=0.620000,['Groups']=0,['EffectType']=88,['Y']=9673,['Color']=992221,['Z']=87920,['X']=79715,['SizeY']=1100,},[8]={['Yaw']=4.752532,['SizeX']=250,['Id']=1021,['SizeZ']=500,['Alpha']=0.540000,['Pitch']=0,['Roll']=0,['Contrast']=0.440000,['Groups']=0,['EffectType']=460,['Y']=11544,['Color']=990003,['Z']=82776,['X']=81880,['SizeY']=500,},[9]={['Yaw']=6.061528,['SizeX']=250,['Id']=1022,['SizeZ']=500,['Alpha']=0.540000,['Pitch']=0,['Roll']=0,['Contrast']=0.440000,['Groups']=0,['EffectType']=460,['Y']=11544,['Color']=990003,['Z']=82776,['X']=81880,['SizeY']=500,},[10]={['Yaw']=3.101450,['SizeX']=4400,['Id']=1031,['SizeZ']=4800,['Alpha']=1,['Pitch']=1.570971,['Roll']=0,['Contrast']=0.780000,['Groups']=0,['EffectType']=910,['Y']=11426,['Color']=991208,['Z']=92101,['X']=78630,['SizeY']=4800,},[11]={['MetaData']={['message']='I remember lying in my hammock in the treetops of Valenwood listening to the hollow tinkling of the bone chimes as the breeze gently whispered through them. No other sound could bring the peace and relaxation that they did. I always loved the smooth and cold feel of bone and leather and the sounds bones make when they are struck. \\n\\nI was taught about the cycles of nature and the seasons. Life begins, grows, ages the same way leaves bud, open and go from green to brown and then it rots away like the crumbling of the dry dead leaves. Life was important and the green was to be protected with the green pact. I was also taught never to waste anything and every part of the animals we hunted and ate was used in some fashion with nothing leftover. It always seemed somehow a dichotomy that when our elders joined the Mundus that although they had passed their knowledge on to the next generation their physical remains and life energy was no longer any use yet we were taught not to waste anything.\\n\\nThe conflicts in Tamriel finally started to affect our areas and we became aware of a strange cult of people. I scouted the worm cult through the vines as they encroached on our territories and curiously watched to learn more before going to make my report.\\n\\nI could see that they had captured a young male wood elf from our outpost that I had grown up with. He was bound in magical wards and biting and clawing every way possible to try to escape. I watched as he was drawn into the black circle they had made. The four worm cult members drew sigils with their hands and chanted exotic sounding phrases and a hazy purplish blue light channeled through the elf drawing out his life energy, funneling it into what I now know is a black soul gem.',['title']='The Thoughts of Vamiril Corpsebloom Part 1',},['Yaw']=1.555088,['Pitch']=5.873033,['Id']=1036,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=1.162389,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=11516,['Color']=991619,['Z']=79112,['X']=76467,['SizeY']=30,},[12]={['MetaData']={['message']='The wood elfs form collapsed to the ground like a ragdoll and was empty. The cult members then placed ritual candles around him and invoked more arcane words and his form stiffly moved and rose to its feet. They packed up their possessions quickly and the elf followed them passively carrying their belongings in a pack on his back with a shambling gait. I hid in the branches too shocked and transfixed to move or comprehend what I\\'d seen. I was horrified completely but also fascinated.\\n\\nI got back to the outpost and told the elders what I had witnessed and they decried the filthy necromancy and vowed to track down the culprits but I had spent so long transfixed that the trail was cold and signs of magical teleportation were left at the end of the trail. They had left for some unknown destination. \\n\\nThe elders disgust with Mannimarcos\\' followers and the mindless state my kinsman was left in made me vow to learn everything I could about necromancy in order to stop my kin from being subdued in this way and largely because I was grimly fascinated. I travelled to Grahtwood for books and traded with Baandari and other more shady individuals to get tomes about the worm cult, Molag Bal and real tomes of extreme necromantic power and learning. \\n\\nI spent my late adolescence reading everything I could get my hands on and learning the finest points of the arts of stealth and evading the law in order to procure even more rare and illegal volumes. I realised that although I had been horrified by what I\\'d seen the necromancers do there was a certain beauty to it. No part of my kin was wasted although he no longer had his freedom mentally or physically. They used his essence in the soul gem later for some purpose unknown but the tomes explained many uses for black soul gems. ',['title']='The Thoughts of Vamiril Corpsebloom Part 2',},['Yaw']=1.539380,['Pitch']=4.712564,['Id']=1037,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=11517,['Color']=991619,['Z']=79064,['X']=76471,['SizeY']=30,},[13]={['MetaData']={['message']='The elfs body did not rot away to dust. There was a certain elegance to it. I wouldn\\'t see it happen to another wood elf I cared about though. What if necromancy could be put to better uses? \\n\\nI experimented with soul gems. I read about bringing back long lost mer by certain rituals, the complexity increasing with the length of time since they were lost. I read about using soul gems to form wards and locks, to enchant clothing, armor and jewellery, to bind the minds of pets and servants and many other exotic uses. \\n\\nMy favourite tome was the rarest, oldest tome snatched from one of the darkest places in Oblivion. It told of a possible way to bind ones essence to a phylactery which could be stored in a pocket plane of Oblivion heavily warded meaning that essentially your form and being can never be lost again and you have immortality. I immediately knew that I was going to learn everything I could about this and work towards achieving this end. First I would become immortal myself and then I would raise my King, an Ayleid of ancient times who I had read much about with knowledge of necromancy and the arcane, a sharp wit and martial prowess and a worthy partner in undead eternity for me. \\n\\nI knew my history and the enslavement and diminishment of mer by man and how they inflict their ways onto other races. The Dominion needed help now more than ever and although the dunmer and orsimer were in the wrong alliance they would come to see the benefits I\\'m sure or learn to serve. Even Queen Ayrenn couldn\\'t have a better plan than I. That feckless fool Mannimarco was stupid to try to take on my master Molag Bal and I will be an exponentially better necromancer than he ever was. \\n\\n\\n\\n\\n\\n\\n\\n\\n\\n\\n',['title']='The Thoughts of Vamiril Corpsebloom Part 3',},['Yaw']=1.539380,['Pitch']=4.771730,['Id']=1038,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=11518,['Color']=991619,['Z']=79013,['X']=76476,['SizeY']=30,},[14]={['MetaData']={['message']='I will have eternity to practice my art and bring peace, prosperity and beauty to all mer who will be served by men. I have used my powers to gain gold and renown already and amassed huge wealth. I have helped countless fools raise lost pets and relatives, enchanted items and areas and formed lucrative alliances. I am friends with many members of The Dark Brotherhood who have passions complementary to my own. They often don\\'t mind if a cadaver of one of their latest offerings to Sithis goes missing. No body, no investigation.\\n\\n I too joined The Dark Brotherhood and give many offerings to Sithis but my goals are in service of my own pursuits and I find the mysteries of Sithis too obscure for my taste but the organisation assists greatly in helping me achieve my goals although I only get cadavers as the souls go to the void. There are no shortage of other souls for me to harvest though. Sithis, the Night Mother and a few select members of the brotherhood do not seem to care as long as certain sacraments are honoured. \\n\\nI have erected by my necromantic will a fortress, castle and palace all in one for me and my Ayleid King to rule Tamriel from. I have learned the beauty of Molag Bals domination and scheming from all my studies of tomes and time in Coldharbour and he is my true master although I have made many deals for power. I have learned that we can dominate the green and harvest its energy and we can use it for our purposes and by doing so it no longer has a short and meaningless cycle but eternal use. It is really dominating to preserve which is true beauty. To live is to die but in undeath is eternity. \\n',['title']='The Thoughts of Vamiril Corpsebloom Part 4',},['Yaw']=1.539380,['Pitch']=5.148721,['Id']=1039,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=11534,['Color']=991619,['Z']=78945,['X']=76481,['SizeY']=30,},[15]={['MetaData']={['message']='I of course cannot allow the planemeld because I need the souls of men to empower my soul forge so I can become an immortal lich. In this I defy the will of my master Molag Bal who would drag all souls to Coldharbour. \\n\\nAfter I complete my transformation I will make other mer who merit it immortal and my King and I will lead them to eternal victory!\\n',['title']='The Thoughts of Vamiril Corpsebloom Part 5',},['Yaw']=1.539380,['Pitch']=5.148721,['Id']=1041,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8502,['Groups']=0,['Contrast']=1,['Y']=11535,['Color']=991619,['Z']=78900,['X']=76479,['SizeY']=30,},},['Version']='15.8.6',},[3]={['TS']=1606632769,['World']='eu',['HouseId']=54,['Effects']={[1]={['Yaw']=4.712389,['SizeX']=150,['Id']=1001,['SizeZ']=2800,['Alpha']=0.300000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=954,['Y']=61710,['Color']=238799,['Z']=80153,['X']=56253,['SizeY']=2800,},[2]={['Yaw']=4.712389,['SizeX']=182,['Id']=1002,['SizeZ']=450,['Alpha']=0.500000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=69,['Y']=61889,['Color']=239099,['Z']=80158,['X']=56304,['SizeY']=450,},[3]={['Yaw']=0,['SizeX']=162,['Id']=1003,['SizeZ']=650,['Alpha']=0.250000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=70,['Y']=61890,['Color']=67199,['Z']=80230,['X']=56193,['SizeY']=650,},[4]={['Yaw']=4.712389,['SizeX']=1800,['Id']=1004,['SizeZ']=1800,['Alpha']=1,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=500,['Y']=62424,['Color']=199,['Z']=83297,['X']=68700,['SizeY']=1800,},[5]={['Yaw']=1.221730,['SizeX']=2800,['Id']=1007,['SizeZ']=2102,['Alpha']=1,['Pitch']=1.570971,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=829,['Y']=60837,['Color']=990742,['Z']=83094,['X']=68916,['SizeY']=2102,},[6]={['Yaw']=1.392773,['SizeX']=1200,['Id']=1044,['SizeZ']=3000,['Alpha']=1,['Pitch']=1.570971,['Roll']=0,['Contrast']=2.290000,['Groups']=0,['EffectType']=910,['Y']=57659,['Color']=999989,['Z']=87088,['X']=72993,['SizeY']=3000,},[7]