hadows. I briefly glanced in the side room, the owner sure likes red wine.\\n\\nDiary Entry 1257\\n\\nThere\\'s some sort of fiery gate back here. The owner is obviously a user of fire magic unless they procured a mages service. I see the gate has droplets of blood floating there, is it some kind of test? I don\\'t see any problem with it, it\\'s probably just decorative to scare people. I\\'m going to try it, I\\'m sure it will be no problem besides the great hall looks very enticing and there has to be plenty of fenceable items.',['title']='Diary',},['Yaw']=3.869395,['Pitch']=4.712564,['Id']=1095,['SizeZ']=30,['Alpha']=1,['SizeX']=26.456456,['Roll']=0,['EffectType']=8503,['Groups']=0,['Contrast']=1,['Y']=33565,['Color']=448799,['Z']=121184,['X']=106933,['SizeY']=30,},[7]={['Yaw']=0.760964,['SizeX']=310,['Id']=1097,['SizeZ']=350,['Alpha']=0.120000,['Pitch']=1.567306,['Roll']=0,['Contrast']=0.620000,['Groups']=0,['EffectType']=620,['Y']=50002,['Color']=2499,['Z']=130766,['X']=115956,['SizeY']=350,},[8]={['Yaw']=0.825541,['SizeX']=1112,['Id']=1099,['SizeZ']=1912,['Alpha']=0.640000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=428,['Y']=52664,['Color']=996054,['Z']=129733,['X']=115251,['SizeY']=1912,},[9]={['Yaw']=0.822050,['SizeX']=1112,['Id']=1100,['SizeZ']=1912,['Alpha']=0.640000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=428,['Y']=52664,['Color']=996553,['Z']=130046,['X']=114942,['SizeY']=1912,},[10]={['Yaw']=1.261873,['SizeX']=752,['Id']=1105,['SizeZ']=1912,['Alpha']=0.640000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=428,['Y']=50367,['Color']=996956,['Z']=132385,['X']=118803,['SizeY']=1912,},[11]={['Yaw']=1.261873,['SizeX']=752,['Id']=1106,['SizeZ']=1912,['Alpha']=0.640000,['Pitch']=0,['Roll']=0,['Contrast']=1,['Groups']=0,['EffectType']=428,['Y']=50367,['Color']=995853,['Z']=131159,['X']=119210,['SizeY']=1912,},[12]={['Yaw']=1.237438,['SizeX']=752,['Id']=1107,['SizeZ']=1912,['Alpha']=0.640000,['P